(45, 34, 1441625974, 1441627986, 'html', 'poems-poems-essays', 'Стих про любовь', 'Стих-про-любовь', NULL, NULL, NULL, NULL, '<p style="margin:0px 0px 6px;color:rgb(20,24,35);font-family:helvetica, arial, sans-serif;font-size:14px;line-height:19px;">Зажгла свечу моей души<br />\nПоник мой темный странник<br />\nСожгла огнем любви<br />\nМои бесславные страдания</p>\n\n<div class="text_exposed_show" style="color:rgb(20,24,35);font-family:helvetica, arial, sans-serif;font-size:14px;line-height:19px;">\n<p style="margin:0px 0px 6px;">И крик твоей души нетленной<br />\nРазбудит мой сгоревший пепел<br />\nВосстал из ада, Я готов! <br />\nПринять тебя, мой милый зов</p>\n\n<p style="margin:6px 0px;">Я всю вселенную покрою<br />\nСвоей безвестной добротой<br />\nПусть знает каждый, в этом мире<br />\nПро ту, кого так сильно я люблю.</p>\n\n<p style="margin:6px 0px;">Ведь ты мой свет<br />\nМоя царица<br />\nТы воплощение меня<br />\nМоя ты Жрица</p>\n</div>\n', 200.00, 31, 0, 0, 'ua', 0, 0),
