(47, 11, 1441628337, 1441629240, 'html', 'videopresentation', 'Презентация', 'Презентация', NULL, NULL, NULL, NULL, '<p style="text-align:center;">Видеопрезентация</p>\n\n<div class="embeddedContent oembed-provider- oembed-provider-youtube" style="text-align:center;"><iframe frameborder="0" height="349" scrolling="no" src="//www.youtube.com/embed/5Fix7P6aGXQ?wmode=transparent&amp;jqoemcache=sGDpV" width="425"></iframe></div>\n\n<p> </p>\n', 1.00, 30, 0, 0, 'at', 64, 65),
