(49, 34, 1441631036, 0, 'html', 'articles', 'Проблема в том что заказчик и исполнитель не могут найти общий язык', 'Проблема-в-том-что-заказчик-и-исполнитель-не-могут-найти-общий-язык', NULL, NULL, NULL, NULL, '<p><span style="color:rgb(20,24,35);font-family:helvetica, arial, sans-serif;font-size:12px;line-height:16px;background-color:rgb(246,247,248);">Чем больше человек вникает в какую нибудь сферу тем шире у него взгляд на нее. И тем глубже он её видит. Открывая для себя все новые и новые аспекты. Появляются слова профессионализмы и понятия которых нет у тех, кто этим не занимается. Пытаясь высказа</span><span style="color:rgb(20,24,35);font-family:helvetica, arial, sans-serif;font-size:12px;line-height:16px;background-color:rgb(246,247,248);">ть свою мысль, он употребляет привычные для него слова. Вкладывая в них свой смысл. Человек который работает в другой сфере. Чисто физически, без всякой подготовки не сможет понять всю технологию производства с первого разговора.<br /><br />Всегда все можно рассмотреть на примерах. Берём любую профессию и раскладываем…<br />Допустим в моем случаи, это режиссёр монтажа.<br />Если мне задают вопрос - что нужно для того что бы сделать качественный, рекламный ролик? Я соответственно, задаю встречный вопрос для уточнения. Что в вашем понимании "качественный рекламный ролик"? Покажите мне референс. И здесь обычно, существует такой ответ - не знаю, вы же профессионал, вот и сами подумайте что это и как должно выглядеть! Ты говоришь - ок! Для, на мой взгляд качественного ролика. Требуется креативный сценарий, подбор соответствующих локаций. Так же нужна команда из оператора, режиссёра, актёров, мейк апера, администратора, плюс техники к оборудованию которые будет использоваться. А это допустим - камера blackmagic 4k с широкоугольными и длиннофокусными объективами. Штатив, квадрокоптер с отдельной камерой и своим оператором. Так же нужен стедикам с оператором. Для съёмки в помещении, если будет такая необходимость, нужны осветительные приборы. На улице так же необходимы светоотражатели и экраны. И это только основное... Ещё можно добавить графику и в этом случаи нужны 3д художники. После того как написан сценарий и отдельно раскадровка, а так же подобраны все локации и утверждены актёры, которых в свою очередь уже придумали во что одеть, костюмеры и как накрасить, мейк апери. Есть список необходимой для съёмки аппаратуры. Мы можем снимать! После чего материал будет передан на монтаж режиссёру, а после утверждения на пост-продакшн. Где в свою очередь разные люди занимаются покраской, масками и графикой. И когда ролик будет готов он может быть качественным. Это все что нужно для создания ролика соответствующему цене - качество.<br /><br />И что мне ответить человек ни разу не задававшийся вопросом о съёмке? - Я и не думал что это все так серьёзно! И хоть он ничего и не понял из того что я ему перечислил. Но все же его представление о съёмках стали немного шире. И после, я ему скажу - 5 000 долларов и я вам сниму нормальный ролик. Он согласиться или нет… Это не важно. Важно то, что если бы я сразу ему назвал цену, ничего не объяснив. Он бы подумал что я его развожу…</span><br />\n </p>\n', 20.00, 12, 0, 0, 'ua', 0, 0),
