INSERT INTO `forum_posts` (`fp_id`, `fp_topicid`, `fp_cat`, `fp_posterid`, `fp_postername`, `fp_creation`, `fp_updated`, `fp_updater`, `fp_text`, `fp_posterip`) VALUES
(15, 8, 'communication', 20, 'kat', 1439996255, 1439996255, '0', '<p>Люди сами выбирают свою дорогу, чему удивляться? Захотели быть объектом социального страдания и чтобы начальство их эксплуатировало - их право. Выхода нет только из гроба, как говорится... А работу достойную всегда найти можно, хоть во фрилансе, хоть где.</p>\n\n<p>По теме - я пришла во фриланс по велению начальства. :) Рвботала в офисе, нужно было найти дизайнера на удаленку, так и узнала про фриланс, сама стала подрабатывать. А потом и на совсем ушла в вольное плавание.</p>\n', '213.231.32.11'),
(11, 7, 'communication', 20, 'kat', 1439991980, 1440006251, 'kat', '<p>Народ, кто как организовывает свое рабочее время? Кто как успевает делать всю работу? Если мы работаем дома, очень велик риск отвлечься на социальные сети, на кофе или интересный фильм. Только у меня так или у всех?<br />\nЯ читала много статей про тайм-менеджмент, даже семинары посещала. Почерпнула там много полезного, но все равно проблема осталась, она мешает выполнять все запланированное и из-за нее не получается зарабатывать столько, сколько могла бы. Что делать?</p>\n', '213.231.32.11'),
(12, 7, 'communication', 17, 'zozulya', 1439992518, 1439992518, '0', '<blockquote><a href="index.php?e=forums&amp;m=posts&amp;q=7&amp;d=1#11">#11</a> <strong>kat:</strong>\n<p>Я читала много статей про тайм-менеджмент, даже семинары посещала. </p>\n</blockquote>\n\n<p>Что за семинары, что там полезного рассказывали? Можно подробнее?</p>\n\n<p>Скажу за себя: поощряю себя чем-то после каждой выполненной задачи. Чашкой кофе, прогулкой с друзьями, походом в кино. Ведь все мы в душЕ дети, хоть и взрослые уже давно. И подход нужен соответствующий.</p>\n', '213.231.32.11'),
(13, 7, 'communication', 20, 'kat', 1439993013, 1439993013, '0', '<p>Много всего, почитайте в инете. Мне запомнилось такое упражнение: если вам надоело или лень работать, разрешите себе ничего не делать. Просто встаньте посреди комнаты и НИЧЕГО НЕ ДЕЛАЙТЕ. Стойте так хотя бы 20 минут: не думайте ни о чем, не смотрите никуда, просто стойте. Очень быстро наскучит и захочется заняться хоть чем-то))) Делаю иногда такую профилактику, помогает)</p>\n', '213.231.32.11'),
(14, 8, 'communication', 17, 'zozulya', 1439993884, 1439993884, '', '<p>Натолкнуло меня на этот вопрос сегодняшнее событие... Свекровь работает учителем в школе, очень хорошо фотографирует, увлекается фотографией, на ее работе об этом знают и всячески пользуются ее навыком и тем, что начальству не отказывают... Вот и делает она бесплатно разную работу: стенды оформляет фотографиями, фотографирует для сайта школы. Однажды даже повредила ногу на такой неоплачиваемой фотосессии. Естественно, ни о какой компенсации со стороны "заказчика" речи не было...</p>\n\n<p>Так вот сегодняшний случай. Обязали ее сфотографировать виды нашего города и найти в интернете старые фотографии тех же мест, чтобы поставить рядом и сравнить, как было и как стало. И места нужны не какие-нибудь, а только нашего района: новый торговый центр, на месте которого раньше был пустырь, новую прогулочную улицу, новую набережную, на которой недавно положили плитку. Хорошая идея, если бы не одно НО: скоро у нас выборы мэра города и райадминистрация просит фотографировать только те места, которые благоустроены действующим мэром. Как оно все благоустраивалось и сколько денег на этом было украдено - писать не стоит... Но люди-то ведутся на эту скрытую рекламу, и опять побегут за него голосовать. Даже учителя не поняли, что их заставили быть бесплатной рекламой, бесплатным пиаром. Просто безропотно делают, что им говорят, и все.</p>\n\n<p>Подумала я про это все и осознала: как же хорошо, что я фрилансер, могу не участвовать в этом всем и не зависеть ни от кого! В такие моменты начинаешь ценить удаленную работу и отсутствие начальства.</p>\n', '213.231.32.11'),
(16, 9, 'communication', 20, 'kat', 1440000513, 1440000513, '', '<p>Дорогие исполнители, помогите советом! Попала в неприятную ситуацию... Заказывала статью у фрилансера, перевела предоплату 50%, получила не совсем то, что хотела, попросила доработать. Исполнитель сказал, что эти требования я не озвучила в ТЗ, поэтому переделывать он не будет. Разве копирайтеры не вносят правки в тексты, если это необходимо. Что делать со второй частью оплаты, переводить или нет?</p>\n', '213.231.32.11'),
(17, 9, 'communication', 17, 'zozulya', 1440003110, 1440005698, 'zozulya', '<blockquote><a href="index.php?e=forums&amp;m=posts&amp;q=9&amp;d=1#16">#16</a> <strong>kat: </strong>\n<p>Разве копирайтеры не вносят правки в тексты, если это необходимо. </p>\n</blockquote>\n\n<p>:) Представьте, что вы заказали в ресторане ростбиф и забыли сказать официанту, чтобы повар его не солил. В итоге ростбиф соленый, есть вы его не можете. Кто виноват? Повар, официант или ваша забывчивость? Вопрос риторический...</p>\n', '213.231.32.11'),
(18, 8, 'communication', 17, 'zozulya', 1440003348, 1440003348, '0', '<blockquote><a href="index.php?e=forums&amp;m=posts&amp;q=8&amp;d=1#15">#15</a> <strong>kat: </strong>\n<p>А работу достойную всегда найти можно, хоть во фрилансе, хоть где.</p>\n</blockquote>\n\n<p>Учителя так не считают, увы.. Не зря говорят - незащищенные слои населения. ЗП 2000 гривен и ничего, кроме преподавания, делать не умеют. Да и с другой стороны - кому-то же надо и детей учить тоже.</p>\n', '213.231.32.11'),
(19, 7, 'communication', 17, 'zozulya', 1440003645, 1440003645, '0', '<p>Спасибо за идею) Постояла, попробовала... Меня хватило на 7 минут. :) Потом пришел сын и сказал: мама, ты какую-то статую изображаешь? Не смогла ребенку объяснить, что это было :) Зато теперь если возникнет приступ лени, я буду знать, что делать.</p>\n\n<p>Еще купила себе ежедневник, поставила на видное место, записываю план на текущий день. С огромным наслаждением вычеркиваю то, что сделала. Но заставить себя это что-то сделать - все равно тяжело.</p>\n', '213.231.32.11'),
(20, 9, 'communication', 21, 'Urban', 1440007723, 1440008003, '', '<p><a href="index.php?e=forums&amp;m=posts&amp;q=9&amp;d=1#17">#17</a> <strong>zozulya:</strong></p>\n\n<p> \n</p><blockquote>Кто виноват? Повар, официант или ваша забывчивость? Вопрос риторический...</blockquote>\n\n\n<p>Иные заведения идут навстречу клиенту, да?) Тут вопрос в заведении и в том, желает ли оно видеть этого привереду рассеянного дальше в своих стенах)))</p>\n<p><strong>Добавлено 2 минуты спустя:</strong></p><p>Уважаемая KAT! Тут все зависит от человека. Заказчик имеет право на забывчивость, а копирайтер должен понимать, что его могут попросить внести некоторые незначительные изменения. Он же не Бог) Другое дело, если у него в райдере это оговорено: правки только за дополнительную плату. Тут уж стоит надеяться только на человечность и порядочность исполнителя. Попытайтесь с ним договориться.</p>\n', '92.47.130.236'),
(21, 8, 'communication', 21, 'Urban', 1440008202, 1440008270, '', '<blockquote><a href="index.php?e=forums&amp;m=posts&amp;q=8&amp;d=1#14">#14</a> <strong>zozulya:</strong>\n<p>Подумала я про это все и осознала: как же хорошо, что я фрилансер, могу не участвовать в этом всем и не зависеть ни от кого! В такие моменты начинаешь ценить удаленную работу и отсутствие начальства.</p>\n</blockquote>\n\n<p>Я пришла во фриланс по воле случая, а случилось то, что я сидела в декретном абсолютно без денег, как и муж. Попался мне на глаза тогда один форум, вот как наш, и оказался он очень полезным. Я вычитала там, что можно зарабатывать деньги в Сети, не выходя из дома. Сейчас-то это вполне реально, а тогда казалось, что вокруг один обман))) Но ничего, почитала о биржах, приложила свое образование и желание не сидеть голодом - и вот уже 4 года пишу на благо Родины)))</p>\n<p><strong>Добавлено 1 минута спустя:</strong></p><blockquote><a href="index.php?e=forums&amp;m=posts&amp;q=8&amp;d=1#15">#15</a> <strong>kat:</strong>\n<p>По теме - я пришла во фриланс по велению начальства. :) Рвботала в офисе, нужно было найти дизайнера на удаленку, так и узнала про фриланс, сама стала подрабатывать. А потом и на совсем ушла в вольное плавание.</p>\n</blockquote>\n\n<p>Скажите, что возвращаться на обычную после фриланса даже и не хочется? Нудятина и рутина.... Ужас!)))</p>\n', '92.47.130.236'),
(32, 9, 'communication', 17, 'zozulya', 1440013426, 1440013426, '0', '<blockquote>\n<p>Иной копирайтер вам и не то скажет, если ему лень и он тот самый "Бог") Если полностью надо переписывать, значит, он сам неправильно понял ТЗ. </p>\n</blockquote>\n\n<p>Может, конечно, я ошибаюсь, но довольно странно слышать это от исполнителя. :) А если бы такое случилось у вас, вы бы переписали всю статью, только потому что заказчик забыл уточнить что-то?</p>\n', '213.231.32.11'),
(23, 11, 'communication', 21, 'Urban', 1440008659, 1440008659, '', '<p>Уважаемые пользователи, недавно столкнулась с такой проблемой, что работы в Сети стало намного меньше. Один мой постоянный заказчик ушел в отпуск на все лето (это случается), другой вынужден был закрыть проект из-за кризиса, третий сократил бюджет. Но ладно бы это, ведь фрилансера ноги кормят: ищи работу, не покладая рук.</p>\n\n<p>Но что творится на биржах? Вы замечали, что заказов стало много меньше, а их оплата оставляет желать лучшего? Нет, конечно есть хорошие проекты, но их же надо ловить, как бешеный пес с пеной у рта))) Кто первый встал, того и тапки.</p>\n\n<p>В общем, хотела спросить: вы почувствовали кризис на себе или у вас все в шоколаде?;)</p>\n', '92.47.130.236'),
(24, 9, 'communication', 20, 'kat', 1440008670, 1440008670, '0', '<blockquote>незначительные изменения</blockquote>\n\n<p> В том-то и дело, что копирайтер говорит, что там нужно переписывать почти всю статью. Поэтому и не хочет вносить правки.  А как по мне - так просто поменять пару абзацев, делов-то..</p>\n', '213.231.32.11'),
(25, 9, 'communication', 21, 'Urban', 1440008909, 1440008909, '0', '<blockquote><a href="index.php?e=forums&amp;m=posts&amp;q=9&amp;d=1#24">#24</a> <strong>kat: </strong>\n<p> В том-то и дело, что копирайтер говорит, что там нужно переписывать почти всю статью. Поэтому и не хочет вносить правки.  А как по мне - так просто поменять пару абзацев, делов-то..</p>\n</blockquote>\n\n<p>Иной копирайтер вам и не то скажет, если ему лень и он тот самый "Бог") Если полностью надо переписывать, значит, он сам неправильно понял ТЗ. Иногда бывает, конечно, что заказчик мудрит и путает следы) Но по вам такого не скажешь, мне кажется. Так что ситуация из рук вон... Если это не повредит вашему бюджету, оплатите ему все и пусть совесть ваша будет чиста, а сам текст попросите переделать кого-то другого. Я так потому говорю, что вас копирайтер задолбит угрозами или настроение будет портить. Сложно все... Я просто всегда иду навстречу человеку, если он адекватный)</p>\n', '92.47.130.236'),
(26, 8, 'communication', 20, 'kat', 1440008982, 1440009022, '', '<p>Да, возвращаться пока не хочется... Но это на данном этапе. Я знаю много случаев, когда люди набираются опыта на фрилансе и уходят на постоянку, с хорошей зарплатой и на хорошие должности. Потому что надоедает постоянно находиться в активном поиске клиентов, не ощущать стабильности... Но это, наверно, должно быть очень заманчивое предложение, чтобы уйти...</p>\n\n<p>Urban, а вы до фриланса где работали?</p>\n', '213.231.32.11'),
(27, 8, 'communication', 21, 'Urban', 1440009333, 1440009333, '0', '<p>Kat, на телевидении - по образованию журналист, филологический факультет закончила. Пять лет, дорогих сердцу, а потом кризис, сокращение и поплыла я по дорогам рекламным: то вечеринки организовавыла, то статьи писала в журнал. Даже арт-директором обозначилась в одном клубе) А потом родила и осела... Только фрилансом и спаслась. Для кого-то он -  единственный вариант в безработицу хоть какую-то копейку сколотить. А бывает, что люди просто ленятся: негоже боярам в кабинетах тесных ютиться да на чужого дядю смотреть)))</p>\n', '92.47.130.236'),
(28, 11, 'communication', 20, 'kat', 1440009404, 1440009404, '0', '<p>Я считаю так: чем лучше специалист, тем меньше ему вреда принесет кризис. Потому что хороших специалистов всегда будет не хватать, а демперы и в спокойные времена жалуются на жизнь. Выживает сильнейший.</p>\n\n<p>Лично меня кризис коснулся, несколько проектов, над которыми работала, тоже пришлось свернуть. Но я надеюсь, что годик-полтора потерпим - и все станет еще лучше. Сколько этих кризисов уже было, а мы как работали, так и работаем.</p>\n', '213.231.32.11'),
(29, 11, 'communication', 21, 'Urban', 1440009917, 1440009917, '0', '<blockquote><a href="index.php?e=forums&amp;m=posts&amp;q=11&amp;d=1#28">#28</a> <strong>kat:</strong></blockquote>\n\n<blockquote>Сколько этих кризисов уже было, а мы как работали, так и работаем.</blockquote>\n\n<p>Позитивные и верные слова) Выживает действительно сильнейший, но как неприятно вкладывать душу в проект,  в котором работало много людей, а он - бах! - и не выжил в кризис. Был один сайт у меня, такой милый сердцу, мы на нем с девочками 1,5 года работали. И заказчик очень хороший, но... не смог удержаться на плаву. Вот и жаль, что столько трудов было вложено, а все закончилось внезапно. Копирайтер будет искать работу, но хороший копирайтер душу оставляет в каждом проекте. Вы как думаете?)</p>\n', '92.47.130.236'),
(30, 12, 'smoking-oom', 21, 'Urban', 1440010466, 1440010520, '', '<p><strong>Приветствую всех работающих и зарабатывающих! </strong>В курилке принято сплетничать и болтать, потому решила спросить у вас: как вы отдыхаете? Я вот люблю на досуге фильм какой-нибудь посмотреть хороший или сериал. Не смейтесь, но только недавно досмотрела "Сверхъестественное" (да-да), жду следующего сезона, а пока увлеклась "Сотней". Хорошее кино, хотя и не без недочетов, но голову расслабляет от работы) Второй сезон заканчивается, а мне хочется новой "крови")</p>\n\n<p><strong>Вы вот что смотрите? </strong>Давайте делиться и советовать друг другу плюшки и радости;)</p>\n', '92.47.130.236'),
(31, 13, 'discussion-f', 1, 'admin', 1440013221, 1440013221, '', '<p>Все моменты по работе сервиса обсуждаем в этом разделе.  (баги, пожелания, удобства, неудобства.)</p>\n', '31.134.210.79'),
(33, 9, 'communication', 21, 'Urban', 1440014988, 1440015053, '', '<blockquote><a href="index.php?e=forums&amp;m=posts&amp;q=9&amp;d=1#32">#32</a> <strong>zozulya: </strong>\n<p>Может, конечно, я ошибаюсь, но довольно странно слышать это от исполнителя. :) А если бы такое случилось у вас, вы бы переписали всю статью, только потому что заказчик забыл уточнить что-то?</p>\n</blockquote>\n\n<p>Наверное, вы не совсем верно меня поняли. Я о том, что если статью надо переписывать полностью, то здесь явно косяк с чьей-то стороны. Вам так не кажется? Бывает и так, что копирайтер сам не понял задание, но утверждает обратное. Бывает, что заказчик требует многое за малые деньги. Всякое бывает.</p>\n\n<p>Тернист путь копирайтера, я лично на нем поначалу очень сильно обжигалась. И статьи писала бесплатно, как оказывалась потом, и переделывала статью, потому что ТЗ было вязкое. Профессионализм со временем приходит, а о каком копирайтере говорит автор поста, мы не знаем. Она вот думает, что можно заменить пару абзацев, а ее исполнитель, что все переделывать. Вот как тут понять? Мне и кажется, что конкретно этому копирайтеру просто лень.</p>\n\n<p> </p>\n', '92.47.130.236'),
(34, 7, 'communication', 21, 'Urban', 1440052736, 1440052736, '0', '<blockquote><a href="index.php?e=forums&amp;m=posts&amp;q=7&amp;d=1#13">#13</a> <strong>kat: </strong>\n<p>Просто встаньте посреди комнаты и НИЧЕГО НЕ ДЕЛАЙТЕ. Стойте так хотя бы 20 минут: не думайте ни о чем, не смотрите никуда, просто стойте. </p>\n</blockquote>\n\n<p>Иногда, когда мой сын жужжит мне прямо в мозг часами, я мечтаю о 20 минутах тишины и ничегонеделания) Но самое интересное, что если голове отдохнуть этого времени иногда даже мало, то тело не согласно бездействовать) </p>\n\n<p>Если же говорить о работе, то я даю себе передышку, если чувствую, что больше не могу написать и буквы. Включаю какой-нибудь фильм и смотрю. Иногда в ущерб сну, но если только и делать, что работать и спать, то жизнь пролетит незаметно. В общем, из меня советчик не очень, так как все мое свободное от работы время подчинено занятиям с ребенком)))</p>\n\n<p>Кстати, я там темку создала о том, кто какие фильмы смотрит и сериалы. Не все же о работе думать. Милости просим)</p>\n', '92.47.130.236'),
(35, 9, 'communication', 22, 'Grezzly', 1440054060, 1440054060, '0', '<p>Ох, женщины! Всегда вам надо сделать проблему из ничего. Вы даете человеку работу, платите за нее, а потом чуть ли не уговариваете что-то там доделать или дописать. Ходить под каблуком у исполнителя? Я вас умоляю...</p>\n', '92.47.130.236'),
(36, 11, 'communication', 22, 'Grezzly', 1440054351, 1440054467, '', '<p>Вечно копирайтеры думают, что им тяжелее всего живется на свете, а мы, заказчики, катаемся, как сыр в масле. Искать надо лучше и продавать свои умения, а не ждать у моря погоды: "Ой, когда же мне предложат писать по 10 баксов за кило?".</p>\n<p><strong>Добавлено 1 минута спустя:</strong></p><blockquote><a href="index.php?e=forums&amp;m=posts&amp;q=11&amp;d=1#28">#28</a> <strong>kat: </strong>\n<p>... а демперы и в спокойные времена жалуются на жизнь. Выживает сильнейший.</p>\n</blockquote>\n\n<p>Нещадно плюсую!</p>\n', '92.47.130.236'),
(37, 12, 'smoking-oom', 22, 'Grezzly', 1440054878, 1440054878, '0', '<p>Сверхъестественное, Сотня... Даже не знаю, что посоветовать в такой ситуации.</p>\n\n<p>Лично мне на просмотр мыла времени свободного не хватает. Если только фильмы: из последних это был "Форсаж 7" и "Исчезнувшая".</p>\n', '92.47.130.236'),
(38, 11, 'communication', 21, 'Urban', 1440059490, 1440059490, '0', '<blockquote><a href="index.php?e=forums&amp;m=posts&amp;q=11&amp;d=1#36">#36</a> <strong>Grezzly: </strong>\n<p>Вечно копирайтеры думают, что им тяжелее всего живется на свете</p>\n</blockquote>\n\n<p>И вам здравствуйте!) Я не говорила, что мне тяжело живется на свете, просто сказала о том, что кризис достает всех: и заказчиков, и копирайтеров. Если вы его на себе не почувствовали, я только рада, но вот мне пришлось лишится пару хороших работодателей. И они, кстати, от этого не в восторге))) А по 10 баксов за кило, как вы сказали - пару раз бывали и такие заказы, но на поток еще их не поставила)</p>\n', '92.47.130.236'),
(39, 12, 'smoking-oom', 21, 'Urban', 1440059657, 1440059657, '0', '<blockquote><a href="index.php?e=forums&amp;m=posts&amp;q=12&amp;d=1#37">#37</a> <strong>Grezzly: </strong>\n<p>Сверхъестественное, Сотня... Даже не знаю, что посоветовать в такой ситуации.</p>\n\n<p>Лично мне на просмотр мыла времени свободного не хватает. Если только фильмы: из последних это был "Форсаж 7" и "Исчезнувшая".</p>\n</blockquote>\n\n<p>Ну я знаю, что меня за выбор могут осудить, но мне нравится))) Расллабляющие сериалы, не заставляют сильно напрягаться, а после работы раве что-то иное нужно? А как вам Исчезнувшая? Я смотрела, понравилось. Аффлек выше всяких похвал, но Розамунд Пайк - это вообще шедевр)</p>\n', '92.47.130.236'),
(40, 13, 'discussion-f', 21, 'Urban', 1440060026, 1440060026, '0', '<p>Доброго! Заметила небольшой баг (или как там его) при регистрации: когда заходишь в меню, там есть опечатка. Правда, не помню уже в какой букве, но она сразу бросается в глаза)))</p>\n', '92.47.130.236'),
(41, 9, 'communication', 17, 'zozulya', 1440061706, 1440061706, '0', '<blockquote><a href="index.php?e=forums&amp;m=posts&amp;q=9&amp;d=1#35">#35</a> <strong>Grezzly: </strong>\n<p>Ох, женщины! Всегда вам надо сделать проблему из ничего. Вы даете человеку работу, платите за нее, а потом чуть ли не уговариваете что-то там доделать или дописать. Ходить под каблуком у исполнителя? Я вас умоляю...</p>\n</blockquote>\n\n<p>Вот потому-то я опасаюсь работать с женщинами, не в обиду женщинам-заказчикам, здесь присутствующим. :) Много через меня прошло клиентов, ни один год в этой сфере тружусь. Так вот с мужчинами почти никаких проблем никогда: задание четкое, общение по делу, все всех понимают. Женщин-заказчиков у меня намного меньше, но с половиной из них что-то не срастается...</p>\n', '213.231.32.11'),
(42, 13, 'discussion-f', 17, 'zozulya', 1440061924, 1440061924, '0', '<p>Так, теперь все вместе ищем опечатку. Кто найдет, тому +100 к рейтингу :)</p>\n', '213.231.32.11'),
(43, 12, 'smoking-oom', 17, 'zozulya', 1440062202, 1440062202, '0', '<p>Я люблю сериалы, но немного их опасаюсь. Потому что не успокоюсь, пока не пересмотрю все серии. Не могу так, чтобы посмотреть 1-2 серии в день и остановиться, нужно ВСЕ СРАЗУ пересмотреть, а это минимум 2 дня из жизни...</p>\n\n<p>Комедийные нравятся, для отдыха мозга и сознания. Недавно вот закончила смотреть Светофор, Сваты, все сезоны - по три раза могу пересматривать. Очень талантливо сделано.</p>\n', '213.231.32.11'),
(44, 11, 'communication', 17, 'zozulya', 1440063171, 1440063171, '0', '<blockquote><span style="line-height:1.6;">Искать надо лучше и продавать свои умения, а не ждать у моря погоды: </span>\n<p> </p>\n</blockquote>\n\n<p>Как? Может, дадите мастер-класс, господин всезнающий Заказчик? </p>\n\n<p>А насчет 10 баксов за кило - так это далеко не потолок в ценнике хорошего копирайтера. Просто далеко не все клиенты понимают важность хороших работающих текстов. Многие считают, что и рерайт за 1 бакс им сойдет. А потом удивляются, почему проекты приходится сворачивать...</p>\n', '213.231.32.11'),
(45, 14, 'communication', 17, 'zozulya', 1440065321, 1440065321, '', '<p>Коллеги, кто из вас проходил платные курсы и тренинги для повышения своего профессионализма? Если да, то какие и есть ли от них толк?<br />\nМне приходит рассылка от одного инфобизнесмена, он предлагает купить его курс по продажам. Знакомые проходили, хвалят, а я вот сомневаюсь. Дело в том, что я сама копирайтер и написала ни один текст, продающий инфопродукты. Убедительно написать текст - половина успеха в инфобизнесе. :) Но сама по себе покупка курса не сделает из вас гуру по продажам. Вот я и сомневаюсь...</p>\n', '213.231.32.11'),
(46, 15, 'communication', 24, 'Lenochka95', 1440066100, 1440066100, '', '<p>Всем привет...</p>\n\n<p><em>Я новичок во фрилансе,даже не знаю, с чего начать.Вот походила по биржам,посмотрела,но все страшно так....Один заказ взяла да что-то напутала там,рейтинг сразу упал.На другой бирже мне вообще ничего не дают,тк я новенькая.Вот пришла сюда,тут пока не занято.</em><em>Я еще студентка,но говорят что можно зарабатывать нормальные деньги,если найти хорошего заказчика.Я вообще люблю книги читать,писала рассказы,почитала в интернете о работе фрилансером,но что нужно для того,чтобы начать зарабатывать?Как мне найти работу?</em></p>\n', '92.47.130.236'),
(47, 12, 'smoking-oom', 24, 'Lenochka95', 1440066338, 1440066338, '0', '<p>ой,я люблю кино смотреть,в нем всегда столько эмоций и переживаний.но тоже если засяду за сериал,так меня краюхой хлеба не оттащищь;))))))</p>\n\n<p>Смотрела Дневники Вампира на два раза уже,а еще люблю индийские сериалы,хотя их очень много.Махабхарата вон по Пятнице сейчас начинается.Наверное буду смотреть.</p>\n', '92.47.130.236'),
(48, 8, 'communication', 24, 'Lenochka95', 1440066674, 1440066674, '0', '<p>Я во фрилансе новичок,даже написала вам ко всем обращение.Надеюсь,примете меня и поможете,а то без денег надоело сидеть,а работу найти такую,чтобы еще время свободное оставалось, трудно.Правда реально зарабатывать по 300долларов в месяц?</p>\n', '92.47.130.236'),
(49, 15, 'communication', 20, 'kat', 1440066945, 1440066945, '0', '<p>Для начала заполните свой профиль, добавьте работы в портфолио, напишите о себе, о своих навыках.</p>\n\n<p>Побольше читайте о фрилансе, развивайтесь. В Интернете масса статей на тему заработка в Интернете, бирж, заказчиков и т.д.</p>\n\n<p>Вначале берите недорогие заказы, нарабатывайте рейтинг, зарабатывайте хорошие отзывы. А дальше уже все пойдет по накатанной.</p>\n\n<p>Эта биржа новая, но и тут скоро будут заказчики. То, что вы зарегистрировались здесь в числе первых - большой плюс.</p>\n', '213.231.32.11'),
(50, 16, 'smoking-oom', 24, 'Lenochka95', 1440067048, 1440067048, '', '<p>В этом году россяине мало отдыхают или мне так показалось?В прошлом году мы с подругой в Турции были,но там наших много и кажется.что ты просто в аквапарк пришел.А в этом не удалось никуда попасть,только по городам помотались немного - Новосибирск, Барнаул,но это скучно же все,хочется солнца и моря.Хотела вот у вас спросить,а вы где были этим летом?Поделитесь,я за вас порадуюсь</p>\n', '92.47.130.236'),
(51, 15, 'communication', 24, 'Lenochka95', 1440067245, 1440067245, '0', '<p>Kat,а что именно читать?Ну вот по фрилансу?Рерайтинг-это мне еще понятно немного,как пересказ своими словами,да?Копирайтинг-это когда вообще все сам пишешь?Я надеюсь,что заказчиков не отпучгнет то,что я новенькая и у меня еще нет работ.В портфолио что поставить,если я еще ничего не писала?И спасибо,что вы мне ответили.Так надоело сидеть без денег,все вокруг отдыхают,а ты как прокляный.</p>\n', '92.47.130.236'),
(52, 13, 'discussion-f', 21, 'Urban', 1440067611, 1440067637, '', '<blockquote><a href="index.php?e=forums&amp;m=posts&amp;q=13&amp;d=1#42">#42</a> <strong>zozulya: </strong>\n<p>Так, теперь все вместе ищем опечатку. Кто найдет, тому +100 к рейтингу :)</p>\n</blockquote>\n\n<p>Давайте мне плюсы в карму, откуда брать?)))) В верхнем левом углу при регистрации написано: запоРлнить форму регистрации</p>\n\n<p>Еще в профиле, когда идешь в настройки, есть блок: разместить рекламу. Там написано: реклаММУ ;)</p>\n\n<p>Вот такая я внимательная))))))))</p>\n', '92.47.130.236'),
(53, 17, 'useful', 24, 'Lenochka95', 1440068179, 1440068179, '', '<p>Друзья!Прочитала,что для работы нужен электронный кошелек вебманей.У меня только карточка,а чтобы вебманей зарегистировать,это что нужно сделать?Я просто боюсь,что он для мошенников лакомый кусочек,вдруг они как-то узнают его номер и деньги с него снимут.Кто сталкивался/,подскажите.Только не смейтесь,что у меня до сих пор кошелька нету-ни к чему он был просто.</p>\n', '92.47.130.236'),
(54, 17, 'useful', 20, 'kat', 1440068565, 1440068565, '0', '<p>На сайте вебмани есть целая энциклопедия, как пользлваться, как обезопасить от мошенников и т.д. https://wiki.webmoney.ru/projects/webmoney/wiki/index Читайте, изучайте. Насчет мошенников - зная номер кошелька, они ничего не смогут у вас украсть. Чтобы украсть ваши деньги, им нужно знать пароль, а пароль приходит на ваш номер телефона в СМС или отправляется на приложение Е-нум, установленное в вашем телефоне... В общем, тут это все долго писать, читайте справку на сайте вебмани.</p>\n', '213.231.32.11'),
(55, 17, 'useful', 24, 'Lenochka95', 1440069444, 1440069444, '0', '<blockquote><a href="index.php?e=forums&amp;m=posts&amp;q=17&amp;d=1#54">#54</a> <strong>kat: </strong>\n<p>В общем, тут это все долго писать, читайте справку на сайте вебмани.</p>\n</blockquote>\n\n<p>Мне просто говорили,что в интеренете деньги хранить небезопасно,но наверное,все зависит от того,какой это кошелек.С карточек же часто деньги воруют,если с ними покупки делать.Сейчас почитаю на вебманей,если что спрошу еще у вас,вы не против?</p>\n', '92.47.130.236'),
(56, 11, 'communication', 22, 'Grezzly', 1440070281, 1440070281, '0', '<blockquote><a href="index.php?e=forums&amp;m=posts&amp;q=11&amp;d=1#44">#44</a> <strong>zozulya: </strong>\n<p>А насчет 10 баксов за кило - так это далеко не потолок в ценнике хорошего копирайтера. Просто далеко не все клиенты понимают важность хороших работающих текстов. Многие считают, что и рерайт за 1 бакс им сойдет. А потом удивляются, почему проекты приходится сворачивать...</p>\n</blockquote>\n\n<p>Рерайт за 1 бакс - это далеко не "пол" в копирайтинге. 25 рублей за кило - вот это полный звездец. Но и платить по 5-10 уЁ за то, что копирайтер почитает что-то в Интернете, перепишет и потом выдаст за авторский текст, я бы тоже не стал. Даже продажник иногда не стоит 10 баксов, в наше-то время.</p>\n\n<p>Мастер-классы не даю, их полно в Сети.</p>\n', '92.47.130.236'),
(57, 9, 'communication', 22, 'Grezzly', 1440070431, 1440070431, '0', '<blockquote><a href="index.php?e=forums&amp;m=posts&amp;q=9&amp;d=1#41">#41</a> <strong>zozulya:</strong></blockquote>\n\n<blockquote>Вот потому-то я опасаюсь работать с женщинами, не в обиду женщинам-заказчикам, здесь присутствующим. :) Много через меня прошло клиентов, ни один год в этой сфере тружусь. Так вот с мужчинами почти никаких проблем никогда: задание четкое, общение по делу, все всех понимают. Женщин-заказчиков у меня намного меньше, но с половиной из них что-то не срастается...</blockquote>\n\n<p>С женщинами много возни, и речь идет не только о работе. Считаю, что им лучше детей воспитывать, нежели пытаться писать умные тексты. Ну только если она действительно не ас в своем деле. Только мне такие не встречались.</p>\n', '92.47.130.236'),
(58, 17, 'useful', 22, 'Grezzly', 1440070515, 1440070515, '0', '<p>О, боги. Куда я попал? Девушка, вы точно хотите быть фрилансером? А то есть еще и камни вместо денег, и натуральный обмен.</p>\n', '92.47.130.236'),
(59, 18, 'critikism', 22, 'Grezzly', 1440070881, 1440070881, '', '<p>Как заказчик опытным (ага!) и новоявленным копирайтерам, мнящим из себя. В общем! Если у вас столько вопросов возникает перед началом работы, может быть, оно и не ваше? Сочинения в школе писать - это совсем другое.<br />\nНам, заказчикам, нужно все по делу и в тему ТЗ. Если вы не знаете, что это такое, не владеете основами сео, с Вордстатом вообще не знакомы, от слова "тошнота" вас тошнит, а заспамленность - это для вас вообще невесть что, если вы не умеете писать продажники и лендинги, описания товаров, не знаете основ копирайтинга... Я лично не могу тратить время, которого у меня и так нет. К вам не обращусь.</p>\n\n<p>Потому большая просьба: перед тем, как искать работу в Сети, просто подумайте. Не тратьте мое время и время таких же занятых людей, как я.</p>\n', '92.47.130.236'),
(60, 9, 'communication', 20, 'kat', 1440082309, 1440082309, '0', '<p>Так умные тексты женщины ж не от хорошей жизни начинают писать, а от того, что мужчины не могут их нормально обеспечить! Не все, конечно, есть те, у кого это призвание. Но рынок переполнен такими авторами, которые только думают, что умеют писать... Есть стереотип, что копирайтинг - самый легкий способ заработка в сети. "Если срочно нужны деньги, то займусь копирайтингом, в школе же сочинения нормально писала". А в результате имеем много мусора и бесполезных текстов в Интернете. А кто виноват? Мужчины :)</p>\n', '213.231.32.11'),
(61, 11, 'communication', 21, 'Urban', 1440082350, 1440082350, '0', '<blockquote><a href="index.php?e=forums&amp;m=posts&amp;q=11&amp;d=1#56">#56</a> <strong>Grezzly</strong></blockquote>\n\n<blockquote>25 рублей за кило - вот это полный звездец.</blockquote>\n\n<p>Это вы не видели еще проекты по 10 рублей за статью. Надеюсь, они не ваши? )))))))</p>\n', '92.47.130.236');
INSERT INTO `forum_posts` (`fp_id`, `fp_topicid`, `fp_cat`, `fp_posterid`, `fp_postername`, `fp_creation`, `fp_updated`, `fp_updater`, `fp_text`, `fp_posterip`) VALUES
(62, 15, 'communication', 21, 'Urban', 1440082580, 1440082580, '0', '<p>Уважаемая Леночка, вам придется пройти долгий путь) Я подозреваю, что он закончится только тогда, когда вы перестанете работать копирайтером. Развиваться можно ежедневно и ежечасно, другое дело, есть ли у вас к этому не только стремление, но и талант? Без него никак, к сожалению. Потому просто хотеть заработать - не вариант. Но зато можно много читать и смотреть на работы других людей, пытаться выполнять дешевые задания, чтобы набить руку. Я сама начинала с таких мелочей, что горбатилась за ноутбуком по 5 часов в день ради 3 долларов.<br />\nЗато опыт - он велик и спать не велит))))</p>\n', '92.47.130.236'),
(63, 8, 'communication', 21, 'Urban', 1440082644, 1440082644, '0', '<blockquote><a href="index.php?e=forums&amp;m=posts&amp;q=8&amp;d=1#48">#48</a> <strong>Lenochka95: </strong>\n<p>Правда реально зарабатывать по 300долларов в месяц?</p>\n</blockquote>\n\n<p>Правда. Реально. Но ох как непросто)</p>\n', '92.47.130.236'),
(64, 17, 'useful', 17, 'zozulya', 1440082688, 1440082688, '0', '<blockquote><a href="index.php?e=forums&amp;m=posts&amp;q=17&amp;d=1#58">#58</a> <strong>Grezzly: </strong>\n<p>О, боги. Куда я попал? Девушка, вы точно хотите быть фрилансером? А то есть еще и камни вместо денег, и натуральный обмен.</p>\n</blockquote>\n\n<p>Не гнобите новичков. :) Все мы когда-то начинали. Хотя я в свое время таких вопросов не задавала, до всего дошла своим умом и гуглом. И как вебмани регистрировать, и как заказы брать, и как сайт свой сделать и много чего еще. </p>\n\n<p>Лена, если вы хотите зацепиться во фрилансе, умейте искать информацию и самосовершенствуйтесь Тут без этого никуда.</p>\n', '213.231.32.11'),
(65, 14, 'communication', 21, 'Urban', 1440082775, 1440082804, '', '<p>Честно говоря, я самоучка. Ни одного тренинга не посещала, но только лишь потому, что не уверена в их эффективности. Точнее, в действенности тех, которые проводятся удаленно. Может быть, это темный век в моей голове, но я предпочитаю учиться в "классе", с живым общением, эмоциями и примерами. Да и курсы эти не такие уж дешевые, да? Вы сами к чему больше склоняетесь: брать или не брать?)</p>\n', '92.47.130.236'),
(66, 18, 'critikism', 21, 'Urban', 1440082924, 1440082924, '0', '<p>Ух ты, какой грозный нам попался заказчик) В ваших словах есть здравый смысл, просто подача не очень мягкая - ваше право, безусловно. Только новичкам так можно очень сильно крылья подрЕзать, а ведь из них вырастают хорошие копирайтеры. Все мы с чего-то начинали, будьте гуманнее и терпеливей)))</p>\n', '92.47.130.236'),
(67, 17, 'useful', 21, 'Urban', 1440083031, 1440083043, '', '<blockquote><a href="index.php?e=forums&amp;m=posts&amp;q=17&amp;d=1#64">#64</a> <strong>zozulya:</strong>ги.\n<p>Не гнобите новичков. :)</p>\n</blockquote>\n\n<p>То же самое я сказала этому грозному товарищу в другой ветке) На горло песне не наступайте, дайте людям шанс. А вы, Лена, сначала читайте и ищите сами, а вот уж если не нашли ничего, тогда дерзайте, пишите и спрашивайте!))))</p>\n', '92.47.130.236'),
(68, 15, 'communication', 20, 'kat', 1440083100, 1440083100, '0', '<blockquote><a href="index.php?e=forums&amp;m=posts&amp;q=15&amp;d=1#51">#51</a> <strong>Lenochka95: </strong>\n<p>Kat,а что именно читать?Ну вот по фрилансу?Рерайтинг-это мне еще понятно немного,как пересказ своими словами,да?Копирайтинг-это когда вообще все сам пишешь?Я надеюсь,что заказчиков не отпучгнет то,что я новенькая и у меня еще нет работ.В портфолио что поставить,если я еще ничего не писала?И спасибо,что вы мне ответили.Так надоело сидеть без денег,все вокруг отдыхают,а ты как прокляный.</p>\n</blockquote>\n\n<p>По копирайтингу есть хороший блог Дениса Каплунова. Это первое, что вспомнилось. А также еще 100500 блогов хороших авторов, где они делятся своими секретами.</p>\n\n<p>Не акцентируйте внимание заказчиков, что вы новенькая и неуверенная. Конечно, писать про опыт, если его нет, не стоит, но вместо "я новенькая" лучше сказать "у меня пока мало опыта, но я сделаю все возможное, чтобы получилось". </p>\n\n<p>Если нечего поставить в портфолио, то пишите для портфолио. Дайте сами себе задание: написать статью на такую-то тему, напишите и выложите.</p>\n', '213.231.32.11'),
(69, 12, 'smoking-oom', 21, 'Urban', 1440083129, 1440083166, '', '<p>Дневники вампира - это хит для многих, но я обошла их стороной. Зато я смотрела Сумерки;)</p>\n', '92.47.130.236'),
(70, 16, 'smoking-oom', 21, 'Urban', 1440083239, 1440083239, '0', '<blockquote><a href="index.php?e=forums&amp;m=posts&amp;q=16&amp;d=1#50">#50</a> <strong>Lenochka95: </strong>\n<p>В этом году россяине мало отдыхают...</p>\n</blockquote>\n\n<p>Все отдыхают в этом году мало. Я даже на речке не была, вот и смейтесь теперь. Планы были грандиозные, но финансы спели мне иную песню.</p>\n\n<p>Хочу, как подорванная, в Европу, но туда нужно еще больше, чем в Турцию)</p>\n', '92.47.130.236'),
(71, 18, 'critikism', 17, 'zozulya', 1440083344, 1440083344, '0', '<p>Ух ты, я уже даже боюсь тут работать. :)</p>\n\n<p>А если серьезно, не обращайте внимание. Помимо новичков, есть и более опытные авторы, которым не надо объяснять про лендинги и тошноту. Просто надо найти своего автора.</p>\n', '213.231.32.11'),
(72, 19, 'smoking-oom', 21, 'Urban', 1440083519, 1440083657, '', '<p>Дорогие товарищи! В связи с ситуаций, происходящей на наших отечественных финансовых рынках и "пускание" курса долларового корабля в свободное плавание, хочется спросить: умеете ли вы держать себя в руках, когда вокруг паника, люди скупают валюту пачками, обменники закрываются, магазины не работают (преимущественно, крупные торговые центры и Интернет-магазины), а ты мечешься посреди этого "полымя" и не знаешь: то ли валерьяночки выпить, то ли пойти доллары поменять или купить)))</p>\n\n<p>Копирайтеру нервы не нужны, его и так дедлайн поджимает, заказчики нервировать могут, домашние дела отвлекать. Как боретесь с этими факторами? Мантрами, успокоительным, самовнушением? Делимся!</p>\n', '92.47.130.236'),
(73, 16, 'smoking-oom', 17, 'zozulya', 1440083787, 1440083787, '0', '<blockquote><a href="index.php?e=forums&amp;m=posts&amp;q=16&amp;d=1#70">#70</a> <strong>Urban</strong>\n<blockquote> </blockquote>\n\n<p>Хочу, как подорванная, в Европу, но туда нужно еще больше, чем в Турцию)</p>\n</blockquote>\n\n<p>Я была в этом году, в странах Скандинавии. Не так дорого, как нас пугали поначалу, чуть денег даже осталось с отдыха. Вообще, не думала, что в этом году удастся вырваться в Европу, кризис же... Но нашелся человек, который вдохновил и убедил, что я могу, главное - захотеть. Побольше бы таких людей... А то что-то одни нытики в реале окружают. :)</p>\n', '213.231.27.208'),
(74, 20, 'communication', 21, 'Urban', 1440084010, 1440084010, '', '<p>Дорогие коллеги! Любопытство сгубило кошку, но мы же люди...</p>\n\n<p>Потому хочется спросить: какой у вас был самый дорогой заказ за все время работы? И что это был за проект? Лично я умудрилась как-то написать продажник за 80 долларов. В символах не измеряем, конечно, но примерно было их 3000 зпб. Это не самый дорогой проект, но пример такого, который сумел побить рекорды в соотношении размер-оплата)))</p>\n\n<p>И мне очень интересно послушать вас: хвастайтесь без зазрения совести, пусть это будет стимулом к новым свершениям для старичков и новичков)</p>\n\n<p> </p>\n', '92.47.130.236'),
(75, 19, 'smoking-oom', 17, 'zozulya', 1440084190, 1440084190, '0', '<blockquote><a href="index.php?e=forums&amp;m=posts&amp;q=19&amp;d=1#72">#72</a> <strong>Urban: </strong>\n<p>Дорогие товарищи! В связи с ситуаций, происходящей на наших отечественных финансовых рынках и "пускание" курса долларового корабля в свободное плавание, хочется спросить: умеете ли вы держать себя в руках, когда вокруг паника, люди скупают валюту пачками, обменники закрываются, магазины не работают (преимущественно, крупные торговые центры и Интернет-магазины), а ты мечешься посреди этого "полымя" и не знаешь: то ли валерьяночки выпить, то ли пойти доллары поменять или купить)))</p>\n</blockquote>\n\n<p>Ой, вспомнила историю... Есть у меня подруга, вообще неконфликтный человек. За 10 лет нашей дружбы раз или два всего ссорились и сразу мирились. Так вот весной, во время массового помешательства "гребите сахар мешками, завтра он будет по 50 гривен" звонит она мне вся такая в панике и говорит: "Тут сахар разметают, завтра будет дороже. Тебе брать?" У меня стресс тогда случился не от того, что сахар разметают, а от того, что дружим мы 10 лет, а она вот такая вот недальновидная - не понимает, что мы сами эту панику нагнетаем, а продавцы в магазинах греют на этом руки. Поссорились в третий раз за 10 лет после того сахара. Но скоро помирились.</p>\n\n<p>А в борьбе со стрессом мне помогают домашние животные, мои кошки. Лучшие антидепрессанты.</p>\n', '213.231.27.208'),
(76, 15, 'communication', 24, 'Lenochka95', 1440085287, 1440085388, '', '<blockquote><a href="index.php?e=forums&amp;m=posts&amp;q=15&amp;d=1#62">#62</a> <strong>Urban: </strong>\n<p>Уважаемая Леночка, вам придется пройти долгий путь)</p>\n</blockquote>\n\n<p>Я понимаю это,просто не хотелось бы слишком много надумать о себе,а потом ошибиться.А вы на какой бирже начинали работу?</p>\n<p><strong>Добавлено 1 минута спустя:</strong></p><blockquote><a href="index.php?e=forums&amp;m=posts&amp;q=15&amp;d=1#68">#68</a> <strong>kat:</strong></blockquote>\n\n<p>Спасибо вам, КАт.Вы так все подробно рассказываете,возитесь со мной.Для меня эти имена не говорят ничего,ноя постараюсь скачать книгу и почитать ее.И за совет спасибо, попробую написать что-нибудь для портфолио.А темы можно любые брать?</p>\n', '92.47.130.236'),
(77, 8, 'communication', 24, 'Lenochka95', 1440085486, 1440085486, '0', '<blockquote><a href="index.php?e=forums&amp;m=posts&amp;q=8&amp;d=1#63">#63</a> <strong>Urban:</strong></blockquote>\n\n<p>Говорят,что некоторые и по тысяче зарабатывают,но я не верю.Это наверное,надо 10 лет проработать для этого?;)</p>\n', '92.47.130.236'),
(78, 16, 'smoking-oom', 24, 'Lenochka95', 1440085574, 1440085574, '0', '<blockquote><a href="index.php?e=forums&amp;m=posts&amp;q=16&amp;d=1#70">#70</a> <strong>Urban:</strong></blockquote>\n\n<p>Да ерунда там в Турции,ничего интересного.Купайся и пей коктейли,за покупками ходи.Хочется чего-то другого,а чего не знаю;)</p>\n', '92.47.130.236'),
(79, 12, 'smoking-oom', 24, 'Lenochka95', 1440085683, 1440085683, '0', '<blockquote><a href="index.php?e=forums&amp;m=posts&amp;q=12&amp;d=1#69">#69</a> <strong>Urban: </strong>\n<p>Дневники вампира - это хит для многих, но я обошла их стороной. Зато я смотрела Сумерки;)</p>\n</blockquote>\n\n<p>Ой,даже стесняюсь сказать,кто мне там нравится.Зато Сумерки я не смотрела,представляете?Но вы наверное,уже догадались,что я фанатею по другому актеру;)А вам кто-то в  Сверхъестесенном симпатичен?Наверное,Дин,да?;)</p>\n', '92.47.130.236'),
(80, 19, 'smoking-oom', 24, 'Lenochka95', 1440085840, 1440085840, '0', '<p>У меня никаких накоплений нет пока,так что и переживать не о чем.Я слышала сегодня по новостям,что творится в соседних странах,это же ужас.Зачем людей в такой стресс вводить?Тут у обменника может уже приступ случиться,а с мешками сахара потом что делать,которые со страху накупили они?;)<br />\nЯ пью успокоительное,если переживаю.В наше время без него никуда.Прямо можно горстями глотать;)А вообще стресс- то плохо, волосы становятся ломкими,ногти,болячки всякие хронические возникают.Не переживайте!</p>\n', '92.47.130.236'),
(81, 9, 'communication', 21, 'Urban', 1440139009, 1440139009, '0', '<blockquote><a href="index.php?e=forums&amp;m=posts&amp;q=9&amp;d=1#60">#60</a> <strong>kat:</strong><span style="line-height:1.6;">)</span></blockquote>\n\n<p>Поддерживаю эту точку зрения. У меня есть одна знакомая семья, где жена трудится, не покладая рук, приходит домой вечером, а потом еще и двух сыновей обстирывает и кормит. Муж же всеми силами старается остаться без работы: пару месяцев трудится, два сидит дома, отдыхает. Когда она родила второго ребенка, он уволился с работы и целый год вместе с ней в декретном сидел))) Пока она на работу сама не вышла да его не выгнала. </p>\n\n<p>Некоторые женщины просто не могут позволить себе не работать, хотя часто они сами бывают виноваты в том, что слишком любили и жалели своих мужей, чтобы потом оказаться в такой сложной ситуации.</p>\n', '95.58.200.137'),
(82, 15, 'communication', 21, 'Urban', 1440139204, 1440139204, '0', '<blockquote><a href="index.php?e=forums&amp;m=posts&amp;q=15&amp;d=1#76">#76</a> <strong>Lenochka95:</strong>\n<blockquote> </blockquote>\n</blockquote>\n\n<p>Я начинала на Текстсэйле. Просто потому, что там была возможность писать тексты в свободную продажу, пробовать себя, а еще брать недорогие заказы с минимумом требований. Ведь оказалось, что писать сценарии и новости на ТВ, слоганы в рекламу - это вообще не то, не копирайтинг) В каждой работе нужны знания и опыт, ничего просто так не делается. Даже простенький рерайт нужно с умом делать, а не левой пяткой)))</p>\n', '95.58.200.137'),
(83, 19, 'smoking-oom', 21, 'Urban', 1440139349, 1440139349, '0', '<blockquote><a href="index.php?e=forums&amp;m=posts&amp;q=19&amp;d=1#80">#80</a> <strong>Lenochka95:</strong>\n<p>Я пью успокоительное,если переживаю.В наше время без него никуда.</p>\n</blockquote>\n\n<p>С недавних пор я тоже перешла на успокоительное. Характер такой, восприимчивый. Даже если не нервничаю внешне, то передиваю внутри. Даже бессонница начиналась одно время, вот и пришлось прибегнуть к лекарствам. Но без фанатизма)</p>\n\n<p>Мешками сахар, рожки пакетами... Что-то это мне напоминает)))</p>\n', '95.58.200.137'),
(84, 12, 'smoking-oom', 21, 'Urban', 1440139457, 1440139457, '0', '<blockquote><a href="index.php?e=forums&amp;m=posts&amp;q=12&amp;d=1#79">#79</a> <strong>Lenochka95</strong>\n<blockquote> </blockquote>\n</blockquote>\n\n<p>Сначала мне нравился Дин, потом Сэм, потом Кастиэль, а после вообще Кроули))) Они все такие разные, но это не восхваление мужчин, как образы, а просто симпатия и покоренность талантом)</p>\n\n<p>А вам нравится в Дневниках вампира Дэймон?)))</p>\n', '95.58.200.137'),
(85, 16, 'smoking-oom', 21, 'Urban', 1440139520, 1440139520, '0', '<blockquote><a href="index.php?e=forums&amp;m=posts&amp;q=16&amp;d=1#78">#78</a> <strong>Lenochka95</strong></blockquote>\n\n<blockquote>\n<blockquote> </blockquote>\n</blockquote>\n\n<p>Тем, кто не купался летом даже в реке, и Турция бы медом показалась)))</p>\n', '95.58.200.137'),
(86, 9, 'communication', 22, 'Grezzly', 1440145305, 1440145305, '0', '<blockquote><a href="index.php?e=forums&amp;m=posts&amp;q=9&amp;d=1#60">#60</a> <strong>kat: </strong>\n<p>Так умные тексты женщины ж не от хорошей жизни начинают писать, а от того, что мужчины не могут их нормально обеспечить!</p>\n</blockquote>\n\n<p>А кто виноват, что они это допустили?</p>\n', '95.58.200.137'),
(87, 20, 'communication', 22, 'Grezzly', 1440145417, 1440145417, '0', '<p>Не повезло заказчику. Продающий текст может стоить и больше, но его должен писать профессионал, а не копирайтер, считающий себя таковым.</p>\n', '95.58.200.137'),
(88, 15, 'communication', 22, 'Grezzly', 1440145484, 1440145516, '', '<p>Леночка "делает" мне день вторые сутки кряду.</p>\n', '95.58.200.137'),
(89, 14, 'communication', 22, 'Grezzly', 1440145565, 1440145565, '0', '<p>Ни в чем нет смысла, если вы его в нем не видите. К чему семинары и тренинги, когда еще Азбука не прочитана?</p>\n', '95.58.200.137'),
(90, 11, 'communication', 22, 'Grezzly', 1440145626, 1440145626, '0', '<blockquote><a href="index.php?e=forums&amp;m=posts&amp;q=11&amp;d=1#61">#61</a> <strong>Urban:</strong></blockquote>\n\n<p>Видел и считаю, что основная масса начинающих копирайтеров должна быть и от этого счастлива. Как и некоторые продолжающие.</p>\n', '95.58.200.137'),
(91, 21, 'communication', 22, 'Grezzly', 1440146248, 1440146248, '', '<p>Основная тенденция на биржах фриланса такова: копирайтеры палец не поднимут, чтобы черкнуть пару строк, прежде чем им предоплату не переведут. Гарантия в отзывах успокаивает только толковых ребят, а новички на всю деревню кричат про "кредитные истории" и "откуда мне знать, что вы меня не обманете". А откуда нам, заказчикам, значть, что они не обманут нас?</p>\n\n<p>Вопрос: давать или не давать предоплату? И работаете ли вы только с единой верой в порядочность заказчика? Я, например, при одном слове "предоплата" от новичка сразу же ставлю его в инор. Коротко и ясно.</p>\n', '95.58.200.137'),
(92, 19, 'smoking-oom', 22, 'Grezzly', 1440146328, 1440146387, '', '<p>На пикничок и шашлычок - помогает. А вообще, если вас нервирует работа, курс доллара, шумные соседи, закипающий чайник, то это уже диагноз. Прорубите в скале пещеру и живите там.</p>\n', '95.58.200.137'),
(93, 18, 'critikism', 22, 'Grezzly', 1440146452, 1440146481, '', '<blockquote><a href="index.php?e=forums&amp;m=posts&amp;q=18&amp;d=1#66">#66</a> <strong>Urban: </strong></blockquote>\n\n<p>Ух ты, какой ценный совет.</p>\n<p><strong>Добавлено 29 секунд спустя:</strong></p><blockquote><a href="index.php?e=forums&amp;m=posts&amp;q=18&amp;d=1#71">#71</a> <strong>zozulya:</strong></blockquote>\n\n<p>Хороших копирайтеров не обижу, не бойтесь.</p>\n', '95.58.200.137'),
(94, 17, 'useful', 22, 'Grezzly', 1440146557, 1440146557, '0', '<blockquote><a href="index.php?e=forums&amp;m=posts&amp;q=17&amp;d=1#64">#64</a> <strong>zozulya:</strong></blockquote>\n\n<p>Стою, молчу, наблюдаю.</p>\n', '95.58.200.137'),
(95, 22, 'communication', 24, 'Lenochka95', 1440146839, 1440147605, 'Lenochka95', '<p><em>Всем привет!Вчера послушала ваши советы и решила заняться своим портфолио.ТОлько не знаю,какую тему лучше выбрать.Может быть,написать что-то о себе?Или про детей,я их оченьлюблю.Или про фриланс можно,да?А еще у меня есть стихотворения,как вы думаете,надо ли их тоже выкладывать?</em></p>\n\n<p><em>Девочки,а что у вас с портфолио лежит?</em></p>\n', '95.58.200.137'),
(96, 11, 'communication', 24, 'Lenochka95', 1440146903, 1440146903, '0', '<blockquote><a href="index.php?e=forums&amp;m=posts&amp;q=11&amp;d=1#61">#61</a> <strong>Urban:</strong></blockquote>\n\n<p>Для новчика,как я,и 25 рублей очень хорошо!Я бы взяла такой заказ,а где посмотреть?</p>\n', '95.58.200.137'),
(97, 15, 'communication', 24, 'Lenochka95', 1440147014, 1440147038, '', '<blockquote><a href="index.php?e=forums&amp;m=posts&amp;q=15&amp;d=1#82">#82</a> <strong>Urban: </strong>\n<blockquote><a href="index.php?e=forums&amp;m=posts&amp;q=15&amp;d=1#76">#76</a> <strong>Lenochka95:</strong>\n<blockquote> </blockquote>\n</blockquote>\n\n<p>Я начинала на Текстсэйле.</p>\n</blockquote>\n\n<p>О,я тоже там хотела зарегистрироваться.Сейчас пойду разбираться,как там и что.Надеюсь,меня примут.Раз уж вы советуете,что новикчам там лучше всего.Я себе поставила цель научиться писать,так что не отсутплю.И извините,если я иногда надоедаю своими вопросами,я не специально,так само выходит.</p>\n<p><strong>Добавлено 24 секунды спустя:</strong></p><blockquote><a href="index.php?e=forums&amp;m=posts&amp;q=15&amp;d=1#88">#88</a> <strong>Grezzly: </strong></blockquote>\n\n<p>Я вас не понимаю;( ВЫ считаете,что я глупая?</p>\n', '95.58.200.137'),
(98, 20, 'communication', 24, 'Lenochka95', 1440147111, 1440147111, '0', '<p>Ой,я пока никаких заказов не делала и ничего не заработала.Но ваш пример прямо порадовал,даже немного оболдела от него;)Меня бы устроило и по 200 долларов в месяц зарабатывать,покрайней мере,иервое время.</p>\n', '95.58.200.137'),
(99, 16, 'smoking-oom', 24, 'Lenochka95', 1440147172, 1440147172, '0', '<blockquote><a href="index.php?e=forums&amp;m=posts&amp;q=16&amp;d=1#85">#85</a> <strong>Urban:</strong></blockquote>\n\n<p>А почему вы ни разу не купались в этом году?</p>\n', '95.58.200.137'),
(100, 12, 'smoking-oom', 24, 'Lenochka95', 1440147322, 1440147322, '0', '<blockquote><a href="index.php?e=forums&amp;m=posts&amp;q=12&amp;d=1#84">#84</a> <strong>Urban:</strong>\n<p>А вам нравится в Дневниках вампира Дэймон?)))</p>\n</blockquote>\n\n<p>Вы угадали!Он такой красивый,я первое время даже влюбилась в него почти,на форумы ходила,где про него пишут и фанаты общаются дневников вампира.Только недавно отпустило немного,даже стыдно вспоминать,как он мне нравился;0То есть и сейчаснравится,но уже как-то спокойнее я стала.</p>\n', '95.58.200.137'),
(101, 23, 'smoking-oom', 24, 'Lenochka95', 1440147544, 1440147581, '', '<p><em>Моя знакомая недавно стала работать в интернете,свой магазин открыла с одеждой.Говорит,что люди хорошо покупают,особенно,детские товары и женскую одежду.Она фрилансером быть никогда не хотела,как вот я.</em></p>\n\n<p><em>А мне вот кажется,что в интернете аферистов много.Ну как вот угадать,что тебе пришлют товар и не обманут,если все требуют оплату вперед?А еще и размеры.У меня сестра заказала туфли своего размера,так пришли и цвет не тот,и размер давит.То ли она спуталато ли заказчик,а деньги возврашать не хотят.</em></p>\n\n<p><em>Вы покупаете вещи в интернете?И как платете за них?</em></p>\n', '95.58.200.137'),
(102, 17, 'useful', 24, 'Lenochka95', 1440147680, 1440147751, '', '<blockquote><a href="index.php?e=forums&amp;m=posts&amp;q=17&amp;d=1#54">#54</a> <strong>kat: </strong></blockquote>\n\n<p>КАТ,скажите,а что лучше:енум или смска с подтверждением?Я никак не могу решить;)Ивобще боюсь лишнее на компьюетр устанавливать.</p>\n<p><strong>Добавлено 39 секунд спустя:</strong></p><blockquote><a href="index.php?e=forums&amp;m=posts&amp;q=17&amp;d=1#58">#58</a> <strong>Grezzly: </strong>\n<p>О, боги. Куда я попал? Девушка, вы точно хотите быть фрилансером?</p>\n</blockquote>\n\n<p>Очень хочу,дайте мне шанс просто!!!!!Я не глупая,</p>\n', '95.58.200.137'),
(103, 20, 'communication', 21, 'Urban', 1440151846, 1440151916, '', '<blockquote><a href="index.php?e=forums&amp;m=posts&amp;q=20&amp;d=1#87">#87</a> <strong>Grezzly: </strong>\n<p>Не повезло заказчику. Продающий текст может стоить и больше, но его должен писать профессионал, а не копирайтер, считающий себя таковым.</p>\n</blockquote>\n\n<p>А вы без своих пяти копеек мимо не проходите))) Продающие тексты обязаны стоить дорого, потому что они продают ваши товары и услуги. Тут голову надо сломать, чтобы попасть в цель. А высокая оплата - награда за эту ломку)))</p>\n<p><strong>Добавлено 1 минута спустя:</strong></p><blockquote><a href="index.php?e=forums&amp;m=posts&amp;q=20&amp;d=1#98">#98</a> <strong>Lenochka95: </strong>\n<p>Ой,я пока никаких заказов не делала и ничего не заработала.Но ваш пример прямо порадовал,даже немного оболдела от него;)Меня бы устроило и по 200 долларов в месяц зарабатывать,покрайней мере,иервое время.</p>\n</blockquote>\n\n<p>Ничего, Леночка! Пару-тройку месяцев и какие-то деньги появятся. Главное, не останавливаться и идти вперед, потому что целеустремленный человек способен горы свернуть без динамита)))</p>\n', '95.58.200.137'),
(104, 15, 'communication', 21, 'Urban', 1440152072, 1440152142, '', '<blockquote> \n<blockquote>\n<blockquote> </blockquote>\n</blockquote>\n\n<blockquote><a href="index.php?e=forums&amp;m=posts&amp;q=15&amp;d=1#88">#88</a> <strong>Grezzly: </strong></blockquote>\n</blockquote>\n\n<p>Товарищ Гризли, оставьте в покое девочку, а то она вас боится уже.</p>\n<p><strong>Добавлено 36 секунд спустя:</strong></p><blockquote><a href="index.php?e=forums&amp;m=posts&amp;q=15&amp;d=1#76">#76</a> <strong>Lenochka95:</strong></blockquote>\n\n<p>А вы, Леночка, будьте сильнее и не выпускайте наружу свои комплексы! Медведи чуют их за версту)))</p>\n', '95.58.200.137'),
(105, 11, 'communication', 21, 'Urban', 1440152298, 1440152298, '0', '<blockquote><a href="index.php?e=forums&amp;m=posts&amp;q=11&amp;d=1#96">#96</a> <strong>Lenochka95</strong>\n<p>Для новчика,как я,и 25 рублей очень хорошо!Я бы взяла такой заказ,а где посмотреть?</p>\n</blockquote>\n\n<p>Леночка, да все на том де Текстсэйле. Давайте так: не бойтесь, регистрируйтесь, берите заказ и пишите. Если что, я помогу вам с рейтингом немного, у меня аккаунт еще работает. Но только после того, как вы САМИ попробуете что-то сделать)))))</p>\n', '95.58.200.137'),
(106, 21, 'communication', 21, 'Urban', 1440152482, 1440152482, '0', '<p>Вопрос ребром, который точно дает понять, что и у Гризли с толстой шкурой бывают определенные дилеммы с "комарами") Скажу так: я верю заказчикам с отзывами, но все равно волнуюсь каждый раз. Если же работодатель всего "2 часа в сервисе" или оставляет для связи почту только, прошу предоплату в 50%. После того, как я пару раз написала таким образчикам хорошие и, как оказалось, бесплатные тексты, мне нужно то самое "подтверждение кредитной истории"))))</p>\n', '95.58.200.137'),
(107, 24, 'discussion-f', 21, 'Urban', 1440152688, 1440152688, '', '<p>Решила вынести вопрос в отдельную тему соответсвующего подраздела. Хотелось бы, чтобы мне приходили в аккаунт уведомления об оставленных комментариях - в моих постах и там, где я что-то писала. А то очень неудобно каждый раз проверять каждый пост на наличие сообщений, чтобы не пропустить важное. Чтобы я зашла в профиль, а там было видно, сколько ответов на мои комментарии дали пользователи, какие и где...</p>\n\n<p>Админ, поможете?)</p>\n', '95.58.200.137'),
(108, 18, 'critikism', 21, 'Urban', 1440152742, 1440152742, '0', '<blockquote><a href="index.php?e=forums&amp;m=posts&amp;q=18&amp;d=1#93">#93</a> <strong>Grezzly</strong>\n<blockquote> </blockquote>\n</blockquote>\n\n<p>Ух ты, а мне все равно не страшно)</p>\n', '95.58.200.137'),
(109, 12, 'smoking-oom', 21, 'Urban', 1440152806, 1440152820, '', '<blockquote><a href="index.php?e=forums&amp;m=posts&amp;q=12&amp;d=1#100">#100</a> <strong>Lenochka95: </strong>\n<blockquote><a href="index.php?e=forums&amp;m=posts&amp;q=12&amp;d=1#84">#84</a> <strong>Urban:</strong>\n<p>А вам нравится в Дневниках вампира Дэймон?)))</p>\n</blockquote>\n\n<p>Вы угадали!Он такой красивый,я первое время даже влюбилась в него почти,на форумы ходила,где про него пишут и фанаты общаются дневников вампира.Только недавно отпустило немного,даже стыдно вспоминать,как он мне нравился;0То есть и сейчаснравится,но уже как-то спокойнее я стала.</p>\n</blockquote>\n\n<p>Мне кажется, он староват немного для молодого вампира, нет?)</p>\n', '95.58.200.137'),
(110, 23, 'smoking-oom', 21, 'Urban', 1440152965, 1440152965, '0', '<p>Честно говоря, я ничего не покупаю в Интернете. Вещи - потому что могу прогадать с размером, учитывая свою комплекцию, "колеблющуюся", как доллар))) Билеты и прочие плюшки - потому что редко жтим пользуюсь и мне надежднее получить все прямо в руки и сразу.</p>\n\n<p>Только комиссию оплачиваю на биржах, плачу за телефон, закидываю деньги на премиум-аккаунт мужу в Танки)))</p>\n', '95.58.200.137'),
(111, 19, 'smoking-oom', 21, 'Urban', 1440153016, 1440153016, '0', '<blockquote><a href="index.php?e=forums&amp;m=posts&amp;q=19&amp;d=1#92">#92</a> <strong>Grezzly: </strong>\n<p>На пикничок и шашлычок - помогает. А вообще, если вас нервирует работа, курс доллара, шумные соседи, закипающий чайник, то это уже диагноз. Прорубите в скале пещеру и живите там.</p>\n</blockquote>\n\n<p>У меня много валерьянки, вам отсыпать?)))</p>\n', '95.58.200.137'),
(112, 25, 'useful', 21, 'Urban', 1440153539, 1440153597, '', '<p>Уважаемые форумчане!</p>\n\n<p>Хотела обсудить с вами вот какой вопрос: как вы думаете, всегда ли прав заказчик? То есть, если он платит деньги, то "музыку" заказывает любую? И в какой угодно форме?</p>\n\n<p>Просто не так давно я стала замечать, что некоторые работодатели не очень-то жалуют копирайтеров (не все, это редкость, но "меткость"). Даже заказ оформляют в грубоватой форме, надменной, что ли... Не говоря уже о самом общении по ходу работы. Мол, не трепите мне нервы, проходите мимо, если вы дураки, не надо со мной торговаться.</p>\n\n<p>Вам вот как кажется, стоит ли терпеть чудачества и характер заказчика, если он нанимает вас на работу?</p>\n\n<p>В обычной жизни ведь терпят загоны директора - и ничего...</p>\n', '95.58.200.137'),
(113, 22, 'communication', 21, 'Urban', 1440154488, 1440154488, '0', '<p>Леночка, а попробуйте посмотреть, о чем пишут другие новички. Это же не так сложно: зайти в их профиль, увидеть тематику, почитать тексты. Так и станет понятно, с какой темой вы скорее всего управитесь)))</p>\n', '95.58.200.137'),
(114, 8, 'communication', 14, 'kayson', 1440154600, 1440154600, '0', '<p>А я в декрете, но без работы сидеть не могу, так что - фриланс. Очень удобно, если есть свободное время, беру заказы. Занимаюсь детьмии и любимой работой, не выходя из дому!</p>\n', '188.231.139.16'),
(115, 8, 'communication', 21, 'Urban', 1440154614, 1440154683, '', '<blockquote><a href="index.php?e=forums&amp;m=posts&amp;q=8&amp;d=1#77">#77</a> <strong>Lenochka95: </strong>\n<blockquote><a href="index.php?e=forums&amp;m=posts&amp;q=8&amp;d=1#63">#63</a> <strong>Urban:</strong></blockquote>\n\n<p>Говорят,что некоторые и по тысяче зарабатывают,но я не верю.Это наверное,надо 10 лет проработать для этого?;)</p>\n</blockquote>\n\n<p>Вопрос из разряда: ответ приходит с опытом)))</p>\n<p><strong>Добавлено 1 минута спустя:</strong></p><blockquote><a href="index.php?e=forums&amp;m=posts&amp;q=8&amp;d=1#114">#114</a> <strong>kayson: </strong>\n<p>А я в декрете, но без работы сидеть не могу, так что - фриланс. Очень удобно, если есть свободное время, беру заказы. Занимаюсь детьмии и любимой работой, не выходя из дому!</p>\n</blockquote>\n\n<p>Наш человек!))) Как мама в декретном отпуске я подтверждаю этот факт! Иного выхода не вижу. так как без работы сидеть не могу, а без денег и того труднее) А вы давно в копирайтинге?</p>\n', '95.58.200.137'),
(116, 22, 'communication', 24, 'Lenochka95', 1440155028, 1440155028, '0', '<blockquote><a href="index.php?e=forums&amp;m=posts&amp;q=22&amp;d=1#113">#113</a> <strong>Urban: </strong>\n<p>Леночка, а попробуйте посмотреть, о чем пишут другие новички. Это же не так сложно: зайти в их профиль, увидеть тематику, почитать тексты. Так и станет понятно, с какой темой вы скорее всего управитесь)))</p>\n</blockquote>\n\n<p>Сейчас посмотрю,спасибо за совет,Урбан.Я как всегда сначала спрашиваю,потом думаю;)</p>\n', '95.58.200.137'),
(117, 21, 'communication', 22, 'Grezzly', 1440162468, 1440162468, '0', '<blockquote><a href="index.php?e=forums&amp;m=posts&amp;q=21&amp;d=1#106">#106</a> <strong>Urban: </strong></blockquote>\n\n<p>А вы не работайте с теми, кому не доверяете. Для заказчика тоже нет гарантии, что его не кинет опытный копирайтер.</p>\n', '95.58.200.137'),
(118, 15, 'communication', 22, 'Grezzly', 1440162542, 1440162542, '0', '<blockquote><a href="index.php?e=forums&amp;m=posts&amp;q=15&amp;d=1#97">#97</a> <strong>Lenochka95:</strong>\n<p>Я вас не понимаю;( ВЫ считаете,что я глупая?</p>\n</blockquote>\n\n<p>Упаси Бог, чтобы я что-то там считал.</p>\n', '95.58.200.137'),
(119, 21, 'communication', 21, 'Urban', 1440178169, 1440178169, '0', '<blockquote><a href="index.php?e=forums&amp;m=posts&amp;q=21&amp;d=1#117">#117</a> <strong>Grezzly: </strong>\n<blockquote><a href="index.php?e=forums&amp;m=posts&amp;q=21&amp;d=1#106">#106</a> <strong>Urban: </strong></blockquote>\n\n<p>А вы не работайте с теми, кому не доверяете. Для заказчика тоже нет гарантии, что его не кинет опытный копирайтер.</p>\n</blockquote>\n\n<p>Согласна, рискуют обе стороны. Но быть обманутым после стольких трудов - это уже перебор. Кто защитит права копирайтера? По закону они ведь у него должны быть или вы их его лишаете?)))</p>\n', '92.47.138.193'),
(120, 24, 'discussion-f', 1, 'admin', 1440232717, 1440232755, '', '<p>Такая возможность будет реализована в дальнейшем, в личном кабинете в настройках: переключатель "да" - "нет" сообщения будут светится в хедере в виде иконки.</p>\n', '31.134.212.203'),
(121, 13, 'discussion-f', 1, 'admin', 1440235372, 1440235372, '0', '<blockquote>\n<p><span style="color:rgb(42,49,59);font-family:''Helvetica Neue'', Helvetica, Arial, sans-serif;font-size:14px;">Давайте мне плюсы в карму, откуда брать?)))) </span></p>\n</blockquote>\n\n<p><img alt="" src="http://freecer.net/img/nth8pzandksyy2w-1.jpg" style="width:229px;height:116px;" /> </p>\n', '31.134.212.203'),
(122, 9, 'communication', 21, 'Urban', 1440439372, 1440439372, '0', '<blockquote><a href="index.php?e=forums&amp;m=posts&amp;q=9&amp;d=1#86">#86</a> <strong>Grezzly:</strong></blockquote>\n\n<p>И рада бы с вами поспорить, да не стану, ведь какая разница. какие у нее были мотивы, если мужик лежит на диване без работы.</p>\n', '92.47.133.234'),
(123, 13, 'discussion-f', 21, 'Urban', 1440439423, 1440439423, '0', '<blockquote><a href="index.php?e=forums&amp;m=posts&amp;q=13&amp;d=1#121">#121</a> <strong>admin:</strong></blockquote>\n\n<p>Спасибо, забрала)))</p>\n', '92.47.133.234'),
(125, 8, 'communication', 14, 'kayson', 1440741420, 1440741420, '0', '<p>Я дизайнер, художник, по этому я больше учавствую в конкурсх, чем принимаю заказы. Но в общей сложности, я уже  около 5-ти лет тусуюсь на разных фриланс-сайтах.</p>\n\n<p style="line-height:20.7999992370605px;">PS: разве я писала что занимаюсь копирайтингом?</p>\n', '188.231.139.16'),
(126, 8, 'communication', 21, 'Urban', 1441194125, 1441194125, '0', '<blockquote><a href="index.php?e=forums&amp;m=posts&amp;q=8&amp;d=1#125">#125</a> <strong>kayson: </strong>\n<p style="line-height:20.7999992370605px;">PS: разве я писала что занимаюсь копирайтингом?</p>\n</blockquote>\n\n<p>Это написала я)</p>\n', '95.58.210.53'),
(127, 8, 'communication', 34, 'zeek', 1441626905, 1441626905, '0', '<p>Всем привет! Я режиссер промо отдела Нового канала. <br />\nИ хочу вам сказать что фриланс на сегодняшний день составляет + 100% моей ЗП. После работы, я прихожу домой и за чашечкой вкусного кофе принимаюсь за работу по фрилансу. У меня это занимает максимум 4 часа в день и при этом выходит в месяц таже сумма что и на оф работе! По этому ответ на ваш вопрос очевиден... В скором времени, все работники мадиа сфер перейдут на удаленную работу... Это гараздо рацыональней! </p>\n', '91.209.55.214');
