INSERT INTO `forum_topics` (`ft_id`, `ft_mode`, `ft_state`, `ft_sticky`, `ft_tag`, `ft_cat`, `ft_title`, `ft_desc`, `ft_creationdate`, `ft_updated`, `ft_postcount`, `ft_viewcount`, `ft_lastposterid`, `ft_lastpostername`, `ft_firstposterid`, `ft_firstpostername`, `ft_poll`, `ft_movedto`, `ft_preview`) VALUES
(19, 0, 0, 0, '', 'smoking-oom', 'Как бороться со стрессом?', 'беседа на фоне колебания курса доллара', 1440083519, 1440153016, 6, 75, 21, 'Urban', 21, 'Urban', 0, '', '&lt;p&gt;Дорогие товарищи! В связи с ситуаций, происходящей на наших отечественных финансовых рынках и &quot;пускание&quot; курс'),
(14, 0, 0, 0, '', 'communication', 'Курсы, семинары, тренинги... Есть ли смысл?', '', 1440065321, 1440145565, 3, 38, 22, 'Grezzly', 17, 'zozulya', 0, '', '<p>Коллеги, кто из вас проходил платные курсы и тренинги для повышения своего профессионализма? Если да, то какие и есть ли</p>'),
(11, 0, 0, 0, '', 'communication', 'А вас зацепил кризис?', 'И фрилансеров тоже зацепило', 1440008659, 1440152298, 11, 119, 21, 'Urban', 21, 'Urban', 0, '', '<p>Уважаемые пользователи, недавно столкнулась с такой проблемой, что работы в Сети стало намного меньше. Один мой</p>'),
(7, 0, 0, 0, '', 'communication', 'Секреты самоорганизации', 'Кто как организует рабочий процесс', 1439991980, 1440052736, 5, 75, 21, 'Urban', 20, 'kat', 0, '', '&lt;p&gt;Народ, кто как организовывает свое рабочее время? Кто как успевает делать всю работу? Если мы работаем дома, очень вели'),
(8, 0, 0, 0, '', 'communication', 'Почему вы пришли во фриланс?', '', 1439993884, 1441626905, 14, 223, 34, 'zeek', 17, 'zozulya', 0, '', '<p>Натолкнуло меня на этот вопрос сегодняшнее событие... Свекровь работает учителем в школе, очень хорошо фотографирует,</p>'),
(9, 0, 0, 0, '', 'communication', 'Рассудите, кто прав', '', 1440000513, 1440439372, 14, 190, 21, 'Urban', 20, 'kat', 0, '', '<p>Дорогие исполнители, помогите советом! Попала в неприятную ситуацию... Заказывала статью у фрилансера, перевела</p>'),
(12, 0, 0, 0, '', 'smoking-oom', 'Сериалы, которые вы смотрите. Советы бывалых', '', 1440010466, 1440152806, 10, 112, 21, 'Urban', 21, 'Urban', 0, '', '&lt;p&gt;&lt;strong&gt;Приветствую всех работающих и зарабатывающих! &lt;/strong&gt;В курилке принято сплетничать и болтать, пот'),
(13, 0, 0, 1, '', 'discussion-f', 'Раздел обсуждения сервиса freecer.net', 'В этом разделе обсуждаем работу сервиса', 1440013221, 1440439423, 6, 149, 21, 'Urban', 1, 'admin', 0, '', '<p>Все моменты по работе сервиса обсуждаем в этом разделе.  (баги, пожелания, удобства, неудобства.)</p>\n'),
(15, 0, 0, 0, '', 'communication', 'Помогите новичку!', '', 1440066100, 1440162542, 11, 150, 22, 'Grezzly', 24, 'Lenochka95', 0, '', '<p>Всем привет...</p>\n\n<p><em>Я новичок во фрилансе,даже не знаю, с чего начать.Вот походила по биржам,посмотрела,но все страшно'),
(16, 0, 0, 0, '', 'smoking-oom', 'Где вы были этим летом?', '', 1440067048, 1440147172, 6, 73, 24, 'Lenochka95', 24, 'Lenochka95', 0, '', '<p>В этом году россяине мало отдыхают или мне так показалось?В прошлом году мы с подругой в Турции были,но там наших много</p>'),
(17, 0, 0, 0, '', 'useful', 'Как создать кошелек.Это безопасно?', '', 1440068179, 1440147751, 8, 98, 24, 'Lenochka95', 24, 'Lenochka95', 0, '', '<p>Друзья!Прочитала,что для работы нужен электронный кошелек вебманей.У меня только карточка,а чтобы вебманей</p>'),
(18, 0, 0, 0, '', 'critikism', 'Кесарю - кесарево, Или работайте на работе', 'наболело', 1440070881, 1440152742, 5, 62, 21, 'Urban', 22, 'Grezzly', 0, '', '<p>Как заказчик опытным (ага!) и новоявленным копирайтерам, мнящим из себя. В общем! Если у вас столько вопросов возникает</p>'),
(20, 0, 0, 0, '', 'communication', 'Ваш самый дорогой заказ. Какой?', '', 1440084010, 1440151916, 4, 57, 21, 'Urban', 21, 'Urban', 0, '', '<p>Дорогие коллеги! Любопытство сгубило кошку, но мы же люди...</p>\n\n<p>Потому хочется спросить: какой у вас был самый дорогой</'),
(21, 0, 0, 0, '', 'communication', 'Предоплата: давать или не давать?', '', 1440146248, 1440178169, 4, 70, 21, 'Urban', 22, 'Grezzly', 0, '', '<p>Основная тенденция на биржах фриланса такова: копирайтеры палец не поднимут, чтобы черкнуть пару строк, прежде чем им</p>'),
(24, 0, 0, 0, '', 'discussion-f', 'Уведомления об ответах', '', 1440152688, 1440232717, 2, 43, 1, 'admin', 21, 'Urban', 0, '', '<p>Решила вынести вопрос в отдельную тему соответсвующего подраздела. Хотелось бы, чтобы мне приходили в аккаунт</p>'),
(22, 0, 0, 0, '', 'communication', 'Портфолио копирайтера', '', 1440146839, 1440155028, 3, 46, 24, 'Lenochka95', 24, 'Lenochka95', 0, '', '&lt;p&gt;&lt;em&gt;Всем привет!Вчера послушала ваши советы и решила заняться своим портфолио.ТОлько не знаю,какую тему лучше выб'),
(25, 0, 0, 0, '', 'useful', 'Клиент всегда прав?', '', 1440153539, 1440153539, 1, 18, 21, 'Urban', 21, 'Urban', 0, '', '&lt;p&gt;Уважаемые форумчане!&lt;/p&gt;\n\n&lt;p&gt;Хотела обсудить с вами вот какой вопрос: как вы думаете, всегда ли прав заказч'),
(23, 0, 0, 0, '', 'smoking-oom', 'Вы желаете покупки в интернете?', '', 1440147544, 1440152965, 2, 24, 21, 'Urban', 24, 'Lenochka95', 0, '', '&lt;p&gt;&lt;em&gt;Моя знакомая недавно стала работать в интернете,свой магазин открыла с одеждой.Говорит,что люди хорошо покупа');
