INSERT INTO `pages` (`page_id`, `page_alias`, `page_state`, `page_cat`, `page_title`, `page_desc`, `page_keywords`, `page_metatitle`, `page_metadesc`, `page_text`, `page_parser`, `page_author`, `page_ownerid`, `page_date`, `page_begin`, `page_expire`, `page_updated`, `page_file`, `page_url`, `page_size`, `page_count`, `page_rating`, `page_filecount`) VALUES
(1, 'Статьи', 0, 'news', 'Получайте больше заказов !!!', 'Чтобы повысить уровень доверия к фрилансерам и работодателям http://freecer.net, администрация рекомендует пользователям пройти простую процедуру верификации (подтверждение личности). Она повысит уровень доверия к вам со стороны потенциальных заказчиков,', '', '', '', '<p><strong>Верификация пользователей</strong></p>\n\n<p>Чтобы повысить уровень доверия к фрилансерам и работодателям www./freecer.net, администрация рекомендует пользователям пройти простую процедуру <a href="http://freecer.net/index.php?e=verification">верификации</a> (подтверждение личности). Она повысит уровень доверия к вам со стороны потенциальных заказчиков, исполнителей и партнеров.</p>\n\n<p><strong><em>Как пройти верификацию?</em></strong></p>\n\n<p>Чтобы стать верифицированным пользователем, нужно:</p>\n\n<p>1. Используя <a href="http://freecer.net/index.php?e=verification">специальную форму</a>, отправить администраторам скан своего паспорта (первая страница).</p>\n\n<p>2. Дождаться, когда администраторы сверят ваши паспортные данные с данными, указанными в аккаунте, и подтвердит, что верификация пройдена.</p>\n\n<p>3. Получить отметку верифицированного пользователя, которая будет отображаться рядом с вашим аватаром.</p>\n\n<p>При принятии решения о сотрудничестве заказчики и исполнители всегда отдают предпочтение верифицированным пользователям. Подтвердите свою личность, и вы не упустите ни единого шанса найти хорошего исполнителя или хорошую работу.</p>\n\n<p>Верификация занимает немного времени. Копии документов, а также все персональные данные пользователей ни при каких обстоятельствах не передаются третьим лицам, хранятся на защищенном сервере <a href="http://freecer.net/">www.freecer.net</a> и могут быть использованы исключительно для подтверждения личности пользователя.</p>\n', 'html', '', 1, 1440669016, 1437688560, 0, 1440669016, 0, '', 0, 141, 0.00, 0),
(4, 'Пользовательское-соглашение', 0, 'system', 'Пользовательское соглашение', '', '', '', '', '<p><strong>1. Основные положения.</strong></p>\n\n<p>1.1. Данный документ является обязательным для прочтения и содержит условия сотрудничества сервиса ООО"Фрикер" (в дальнейшем Администрация) с физическим или юридическим лицом (в дальнейшем Пользователь), а также включает права и обязанности сторон, заключивших договор. Использование сервиса означает согласие с данными правилами и другими документами, регулирующими порядок использования сервиса.</p>\n\n<p><strong>2. Основные термины и понятия.</strong></p>\n\n<p>2.1. Сайт или Сервис – веб-страницы, программные и аппаратные составляющие, которые объединены общим доменом www.freecer.net и созданы для взаимодействия всех лиц, использующих Сайт.</p>\n\n<p>2.2. Администрация – сотрудники Сервиса, которые отвечают за работу Сайта и могут контактировать с Пользователями по мере необходимости.</p>\n\n<p>2.3. Пользователь – лицо, прошедшее процедуру Регистрации и обладающее доступом к сервисам Сайта.</p>\n\n<p>2.4. Регистрация – обязательная для всех Пользователей процедура, при которой каждому пользователю присваивается уникальный логин и пароль – данные, необходимые для полного доступа к персональным страницам и сервисам Сайта.</p>\n\n<p>2.5. Заказчик – Пользователь, который публикует объявления о поиске Исполнителей для выполнения определенного объема работ.</p>\n\n<p>2.6. Исполнитель – Пользователь, который использует Сайт для поиска работы по своей специализации.</p>\n\n<p>2.7. Проект – объявление о поиске Исполнителя для выполнения определенной работы за оговоренную плату.</p>\n\n<p>2.8. Магазин – раздел сайта, в котором Исполнители могут выставлять на продажу готовые работы, а Заказчики покупать их за оплату, установленную Исполнителями.</p>\n\n<p><strong>3. Предмет соглашения.</strong></p>\n\n<p>В рамках Сервиса каждый Пользователь имеет возможность:</p>\n\n<p>3.1. Публиковать данные для информирования других Пользователей в своем личном профиле (контактные данные, резюме, работы в портфолио).</p>\n\n<p>3.2. Размещать предложения о работе и обращаться к Пользователям, которые, по мнению работодателя, могут ее выполнить.</p>\n\n<p>3.3. Осуществлять поиск работы, оставлять отклики на предложения Работодателей, соблюдая условия по оплате услуг.</p>\n\n<p>3.4. Осуществлять покупку или продажу готовых работ, используя соответствующий раздел Сайта.</p>\n\n<p><strong>4. Ответственность сторон.</strong></p>\n\n<p>4.1. Пользователь обязуется:</p>\n\n<p>4.1.1. Регистрироваться на сервисе только один раз, не создавать новых учетных записей в случае блокировки аккаунта или утери пароля, не покупать чужие и не продавать свои учетные записи третьим лицам, а также не передавать к ним доступ.</p>\n\n<p>4.1.2. Своевременно вносить оплату за услуги Сайта.</p>\n\n<p>4.1.3. Предоставлять правдивые персональные данные и следить за их актуальностью.</p>\n\n<p>4.1.4. Осуществлять работу на Сайте согласно актуальной версии его правил.</p>\n\n<p>4.1.5. Брать на себя все обязательства перед Заказчиком относительно выполнения работы.</p>\n\n<p>4.1.6. Публиковать и откликаться только на те проекты, которые подразумевают материальное вознаграждение, не предлагать и не выполнять работу за отзыв или работу на бартерной основе.</p>\n\n<p>4.1.7. Не использовать сервисы Сайта в противоправных целях.</p>\n\n<p>4.1.8. Нести ответственность за сохранность своих персональных данных, в частности логина и пароля с целью защиты своей учетной записи от взлома и незаконного использования.</p>\n\n<p>4.1.9. Нести ответственность за любую информацию, размещенную на персональных страницах Сайта, не размещать запрещенные материалы, такие как изображения сцен насилия, пропаганда наркотиков, реклама сервисов, противоречащих законодательству.</p>\n\n<p>4.1.10. Не размещать в своем портфолио работы, которые являются чужой интеллектуальной собственностью.</p>\n\n<p>4.1.11. Не распространять посредством личных сообщений или публикации на страницах Сайта спам, материалы, содержащие вирусы, материалы с нецензурными выражениями, материалы, которые несут оскорбительный характер или являются клеветой.</p>\n\n<p>4.1.12. Не создавать проектов и не производить других действий, нацеленных на искусственное повышение рейтинга (указание неверной стоимости проекта, написание неправдивых отзывов и т.д.)</p>\n\n<p>4.2. В случае нарушения данных правил или при возникновении у Администрации подозрений на их нарушение учетная запись Пользователя может быть заблокирована без предупреждения и/или возможности восстановления.</p>\n\n<p>4.3. Администрация имеет право:</p>\n\n<p>4.3.1. Отказать Пользователю в предоставлении услуг, если возникло подозрение в нарушении правил использования сервиса.</p>\n\n<p>4.3.2. Удалять или блокировать информацию, размещенную Пользователем, если она, по мнению Администрации, противоречит правилам сервиса.</p>\n\n<p>4.3.3. Изменять внешний вид, структуру и функционал сайта, а также тарифы за обслуживание.</p>\n\n<p>4.3.4. Проводить профилактические работы, сопровождающиеся временным закрытием Сайта с целью улучшения работы и модернизации сервиса, повышения безопасности Пользователей и их персональной информации.</p>\n\n<p>4.3.5. Не рассматривать споры, возникающие между Заказчиком и Исполнителем, если такая услуга не была заказана и оплачена до заключения сделки. При этом Администрация может блокировать Пользователей, которые подозреваются в мошенничестве или других</p>\n\n<p>противоправных действиях и на которых поступают жалобы от других Пользователей.</p>\n\n<p><strong>5. Оплата услуг сервиса.</strong></p>\n\n<p>5.1. Заказчики используют все сервисы Сайта бесплатно, за исключением безопасных сделок и юридического сопровождения проектов.</p>\n\n<p>5.2. Исполнители оплачивают возможность подавать заявки на проекты в определенных категориях в соответствии с актуальными Тарифами (ссылка).</p>\n\n<p>5.3. Сервис взымает с Исполнителей комиссию после каждого завершенного проекта и опубликованного в адрес Исполнителя положительного отзыва. Комиссия составляет 3% от заявленной стоимости проекта.</p>\n\n<p>5.4. Администрация вправе изменять порядок получения оплаты и тарифы.</p>\n\n<p>5.5. Средства, потраченные на оплату услуг Сайта, не возвращаются, если услуги не были использованы по личным причинам Пользователя.</p>\n\n<p><strong>6. Порядок заключения и расторжения соглашения.</strong></p>\n\n<p>6.1. Регистрируясь на Сайте, Пользователь принимает все условия данного соглашения и обязуется следовать всем правилам, которые могут быть внедрены и приняты после его регистрации.</p>\n\n<p>6.2. Администрация сайта имеет право в одностороннем порядке расторгнуть данное соглашение в случае нарушения Пользователем правил или, если его учетная запись не была использована в течение 12 календарных месяцев. </p>\n\n<p><strong>7. Рассмотрение споров.</strong></p>\n\n<p>7.1. Администрация сайта не занимается рассмотрением споров, возникающих между Заказчиком и Исполнителем в процессе работы, а также не несет ответственности за ущерб, причиненный любой из сторон вс.</p>\n\n<p>7.2. Администрация рассматривает споры только в случае оформления безопасной сделки или при заказе услуги «Сопровождение проекта».</p>\n', 'html', '', 1, 1441382030, 1439471520, 0, 1441382030, 0, '', 0, 107, 0.00, 0),
(5, 'Политика-конфиденциальности', 0, 'system', 'Политика конфиденциальности', '', '', '', '', '<p><strong>1. О персональных данных</strong></p>\n\n<p>a. Регистрируясь в системе, каждый Пользователь тем самым автоматиче-ски соглашается с тем, что его личные данные вносятся в базу данных нашего Сервиса и обрабатываются согласно актуальным на момент ре-гистрации нормативно-правовым актам.</p>\n\n<p>b. Использование данных Пользователя является необходимым условием для функционирования Сайта и для предоставления Пользователю со-ответствующих услуг.</p>\n\n<p>c. Личные данные Пользователя хранятся в базе данных Сайта весь пери-од начиная от регистрации Пользователя и заканчивая удалением (бло-кировкой) его учетной записи.</p>\n\n<p><strong>2. Порядок обработки персональных данных</strong></p>\n\n<p>a. Факт регистрации Пользователя на Сервисе означает добровольное со-гласие на хранение и обработку личной информации. В частности, это касается данных, передаваемых программным обеспечением Пользова-теля, которое используется для работы в Сервисе.</p>\n\n<p>b. Персональные данные Пользователя становятся доступными на его странице в Сервисе и по факту, могут быть использованы третьими ли-цами. Однако это не касается служебных данных, которые Сервис пере-дает Пользователю, а также информации, передаваемой ПО пользова-теля.</p>\n\n<p>c. За использование личных данных пользователя Сервис никакой ответ-ственности не несет.</p>\n\n<p>d. Сервис берет на себя обязанность защищать персональные данные Пользователей всеми разрешенными современным законодательством методами. Однако в результате выхода из строя аппаратной или про-граммной части Сайта, хакерской атаки, личные данные Пользователя могут стать доступны третьим лицам.</p>\n\n<p><strong>3. Права пользователей</strong></p>\n\n<p>a. Пользователи обладают всеми правами по защите своей персональной информации, не противоречащими действующему законодательству.</p>\n\n<p>b. Пользователь может заблокировать собственную Учетную Запись – для этого нужно отправить к Менеджерам Сервиса соответствующий запрос.</p>\n\n<p>c. Удаление персональных данных происходит в соответствии с действу-ющим законодательством.</p>\n', 'html', '', 1, 1439471640, 1439471640, 0, 1439822143, 0, '', 0, 28, 0.00, 0),
(6, 'Правила-исполнителям', 0, 'system', 'Правила исполнителям', '', '', '', '', '<p><strong>Поиск работы.</strong></p>\n\n<p>Исполнителям доступны предложения работы по проектам, конкурсам и вакансиям во всех категориях. Для поиска регулярно просматривайте раздел Проекты и подразделы Удаленная работа, Биржа вакансий, Конкурсы. Если вы приобрели тарифный план второго и третьего уровня, для вас также доступны предложения из Платного раздела.</p>\n\n<p>Чтобы быстро найти интересующие предложения от работодателей, пользуйтесь фильтром категорий, а также сортируйте проекты по цене и региону. Для этого используйте блок, который находится в левой части экрана.</p>\n\n<p>Регулярно просматривайте новые проекты по вашему профилю и старайтесь оставить заявку как можно раньше. Это увеличит шанс того, что заказчик отдаст проект именно вам.</p>\n\n<p> </p>\n\n<p><strong>Выбор тарифного плана. </strong></p>\n\n<p>Любой пользователь, который зарегистрировался на сайте http://freecer.net, может подавать заявки к проектам. Каждому новому пользователю автоматически оформляется тарифный план первого уровня, который предусматривает возможность оставить пять заявок в течение месяца. Заявки можно подавать во все категории и на все виды работ, кроме Платного раздела.</p>\n\n<p>Если исполнитель хочет подавать большее количество заявок и иметь доступ к более дорогим проектам из Платного раздела, мы рекомендуем оформить тарифный план второго или третьего уровня.</p>\n\n<p>Стоимость тарифного плана второго уровня – 3 долл. Количество заявок – 30.</p>\n\n<p>Стоимость тарифного плана третьего уровня – 5 долл. Количество заявок – не ограничено.</p>\n\n<p>Срок действия всех тарифных планов – 1 месяц с момента оформления.</p>\n\n<p> </p>\n\n<p><strong>Подача заявок.</strong></p>\n\n<p>Выбрав интересующий вас проект, дайте работодателю знать, что готовы обсудить подробности работы и приступить. Для этого оставьте заявку к проекту. В соответствующих графах укажите стоимость, сроки, если необходимо, прикрепите к заявке файл с информацией, которая может быть интересна заказчику (бриф, пример аналогичной работы и т.д.).</p>\n\n<p>В тексте заявки напишите, почему заказчику лучше доверить работу по проекту именно вам, опишите свои конкурентные преимущества, опыт аналогичной работы. Старайтесь заинтересовать заказчика, чтобы он заметил вас среди других кандидатов.</p>\n\n<p>При необходимости поставьте галочку «Сделать предложение видимым только для заказчика». В этом случае другие исполнители не увидят текста вашей заявки.</p>\n\n<p>Обсудите с заказчиком подробности сотрудничества посредством личных сообщений и дождитесь, когда он выберет вас исполнителем.</p>\n\n<p> </p>\n\n<p><strong>Сотрудничество.</strong></p>\n\n<p>Приступайте к выполнению заказа только после того, как заказчик выберет вас исполнителем. Если это необходимо, попросите заказчика указать вас Исполнителем. Только после выбора исполнителем вы сможете подтвердить получение оплаты и обменяться отзывами. Данная мера введена для безопасности сторон и для гарантии того, что они выполнят обязательства по отношению друг к другу.</p>\n\n<p>Чтобы сотрудничество было успешным, подходите к выполнению задания ответственно и профессионально. Соблюдайте сроки и регулярно выходите на связь для своевременного решения текущих вопросов. Вносите корректировки в рамках технического задания, передавайте заказчику исходные материалы и отвечайте на все его вопросы.</p>\n\n<p>Для безопасности обеих сторон ведите переписку с заказчиком, используя чат на нашем сайте. Общение через электронную почту, Skype и другие сторонние средства связи не гарантируют того, что от вашего имени с заказчиком не общается мошенник. Также переписка в рамках сервиса http://freecer.net в случае возникновения споров может стать доказательством вашей правоты. Логи переписки электронной почты и других сторонних сервисов не рассматриваются администрацией как доказательства.</p>\n\n<p>Когда работа по проекту подойдет к концу и вы получите оплату, подтвердите ее получение, нажав на соответствующую кнопку на странице проекта.</p>\n\n<p> </p>\n\n<p><strong>Публикация отзывов.</strong></p>\n\n<p>После завершения работы над проектом и получения оплаты напишите отзыв о сотрудничестве.</p>\n\n<p>Это можно сделать, перейдя в профиль заказчика на странице с отзывами. В выпадающем списке будет отображен проект, в котором заказчик выбрал вас исполнителем. Выберите его, напишите текст отзыва, укажите его тип (положительный или отрицательный) и нажмите кнопку Добавить.</p>\n\n<p>В двух словах опишите впечатления от сотрудничества. Оцените, насколько четко была поставлена задача, своевременно ли заказчик отвечал на вопросы и производил оплату или укажите другую информацию, полезную для исполнителей.</p>\n\n<p>Иногда заказчики неохотно оставляют отзывы, даже если они довольны сотрудничеством. Это может быть связано с нехваткой времени или с тем, что заказчик недооценивает важность отзыва для исполнителя. Если вы уверены, что справились с работой хорошо, не стесняйтесь напоминать заказчику о необходимости оставить отзыв. Это займет у него совсем немного времени.</p>\n\n<p> </p>\n\n<p><strong>Оплата комиссии.</strong></p>\n\n<p>За каждый завершенный проект исполнитель оплачивает сервису комиссию в размере 3% от стоимости проекта. Если проект был оформлен через безопасную сделку, размер комиссии составляет 5%. Комиссия взымается с исполнителя в двух случаях:</p>\n\n<p>1. Если заказчик присвоил проекту статус Выполнен и оставил положительный отзыв.</p>\n\n<p>2. Если истекли сроки, указанные исполнителем в проекте, а исполнитель, в свою очередь, подтвердил получение оплаты.</p>\n\n<p>Исполнитель должен оплатить комиссию в течение 10 дней с момента публикации положительного отзыва от заказчика.</p>\n\n<p> </p>\n\n<p><strong>Формирование рейтинга.</strong></p>\n\n<p>Рейтинг фрилансера указывает на уровень его профессионализма и демонстрирует, что ему можно доверять. Он измеряется в баллах и графически выражается в звездочках, расположенных рядом с аватаркой.</p>\n\n<p>Рейтинг формируется следующим образом:</p>\n\n<p>За посещение сайта: +1 балл</p>\n\n<p>За размещение работы в портфолио: +1 баллов </p>\n\n<p>За статус исполнителя по проекту: +1 балл</p>\n\n<p>За получение отказа по проекту: -1 балл</p>\n\n<p>За получение положительного отзыва: +20 баллов</p>\n\n<p>За получение отрицательного отзыва: -20 баллов</p>\n\n<p>За покупку Тарифного плана: +20% к рейтингу.</p>\n\n<p>Фрилансеры с самыми большими значениями рейтинга попадают в ТОП каталога исполнителей и имеют больше шансов получить выгодное предложение от заказчика.</p>\n\n<p>Любые действия, направленные на искусственную накрутку рейтинга, запрещены правилами ресурса. Администрация вправе принимать меры по отношению к нарушителям правил вплоть до блокировки аккаунта.</p>\n', 'html', '', 1, 1439739900, 1439739720, 0, 1439822013, 0, '', 0, 18, 0.00, 0),
(11, 'Правила-заказчикам', 0, 'system', 'Правила заказчикам', '', 'правила заказчикам', '', '', '<p><strong>Публикация проекта.</strong></p>\n\n<p>Проект – это предложение работы для исполнителей, в котором заказчик описывает суть работы и указывает требования к ее выполнению. Биржа <a href="http://freecer.net/">http://freecer.net</a> дает возможность публиковать предложения работы трех типов:</p>\n\n<p><strong><em>Удаленная работа</em></strong> – разовый проект, в рамках которого необходимо выполнить конкретный объем работы.</p>\n\n<p><strong><em>Вакансия</em></strong> – предложение, целью которого является поиск исполнителя на определенную должность на постоянной основе.</p>\n\n<p><strong><em>Конкурс</em></strong> – публикация задания с целью получения самого лучшего результата на конкурсной основе.</p>\n\n<p>Публикация проектов бесплатна для заказчиков и занимает всего несколько минут. Чтобы найти исполнителя, перейдите в раздел «Проекты» и нажмите кнопку «Добавить проект». Выберите из списка тип проекта, укажите категорию и заполните другие поля формы. Старайтесь кратко и по сути описать характер предстоящей работы, чтобы исполнители могли сразу понять, смогут ли они справиться с заданием и стоил ли им подавать заявку. Так вы сэкономите свое время и будете выбирать исполнителя из тех фрилансеров, которые больше всего подходят.</p>\n\n<p>К проекту можно добавить файл, содержащий техническое задание или другую необходимую для работы информацию.</p>\n\n<p>Если вас интересуют исполнители более высокого уровня, поставьте галочку «Разместить только для профессионалов». В этом случае проект будет виден только тем исполнителям, которые имеют доступ к Платному разделу.</p>\n\n<p>После модерации проект будет размещен на сайте и станет видимым для исполнителей.</p>\n\n<p> </p>\n\n<p><strong>Выбор исполнителя.</strong></p>\n\n<p>Дождитесь, когда исполнители начнут оставлять заявки к вашему проекту. Просматривайте их резюме, портфолио и отзывы от прошлых заказчиков. Обращайте внимание на рейтинг и на время работы в сервисе. Если исполнитель просит у вас предоплату, будьте предельно внимательны. Не перечисляйте предоплату фрилансерам без отзывов и рейтинга, который отображает уровень профессионализма и деловой активности на сайте.</p>\n\n<p>Если претендент указывает слишком высокую цену проекта или если его условия сотрудничества вас не устраивают, вы можете отказать ему. Делайте это только в особых случаях, поскольку отказ заказчика приводит к понижению рейтинга исполнителя.</p>\n\n<p>Обсудите детали сотрудничества с подходящими кандидатами, пользуясь чатом на странице проекта. Начинайте сотрудничество только после того, как озвучите исполнителю все требования и ответите на его вопросы.</p>\n\n<p>Обсуждайте предстоящее сотрудничество как можно подробнее. Выясните у исполнителя:</p>\n\n<ol><li>Способы и порядок оплаты.</li>\n	<li>Сроки и стоимость работы.</li>\n	<li>Порядок предоставления всех необходимых материалов.</li>\n	<li>Гарантии качества и возможность последующей поддержки по проекту.</li>\n</ol><p>Для гарантии надежности используйте безопасную сделку. При безопасной сделке сумма, которая необходима для оплаты исполнителю, замораживается на счету биржи и перечисляется фрилансеру только после выполнения работы и вашего подтверждения, что работа выполнена хорошо и в полном объеме.</p>\n\n<p> </p>\n\n<p><strong>Сотрудничество.</strong></p>\n\n<p>Начинайте сотрудничество с фрилансером только после того, как обозначите его исполнителем, нажав соответствующую кнопку на странице проекта. Только так вы в будущем сможете оставить фрилансеру отзыв.</p>\n\n<p>Сформулируйте задачу максимально четко и подробно. Это поможет исключить недопонимание и связанные с этим проблемы, возникающие из-за того, что исполнитель неправильно понял ваши требования.</p>\n\n<p>Регулярно выходите на связь с исполнителем, интересуйтесь, на каком этапе находится выполнение заказа, отвечайте на вопросы, которые могут возникнуть у фрилансера в процессе работы. Если у вас есть уточнения и корректировки задания, сообщайте об этом исполнителю как можно раньше. Помните, что исполнитель не обязан выполнять дополнительные требования, если они не входили в первоначальное задание и не были учтены в стоимости проекта.</p>\n\n<p> </p>\n\n<p><strong>Публикация отзывов.</strong></p>\n\n<p>Если исполнитель выполнил работу и она соответствует вашим требованиям, произведите полную оплату, подтвердите выполнение проекта и оставьте отзыв. Для добавления отзыва перейдите в профиль исполнителя (вкладка Отзывы) и выберите проект, по которому вы сотрудничали. В отзыве кратко опишите уровень профессионализма фрилансера, четкость соблюдения сроков, то, как он подходит к выполнению работы, часто ли выходит на связь и т.д. В течение пяти календарных дней вы можете отредактировать отзыв, если ваше мнение о сотрудничестве изменилось.</p>\n\n<p>В конце сотрудничества исполнитель также должен оставить вам отзыв. Чтобы он был положительным, своевременно произведите оплату за работу и выполните другие условия, если это необходимо. Положительный отзыв заказчика увеличивает доверие к нему со стороны исполнителей и способствует повышению рейтинга.</p>\n\n<p> </p>\n\n<p><strong>Платное размещение проектов.</strong></p>\n\n<p>Если вы хотите, чтобы ваш проект увидело как можно большее число исполнителей, воспользуйтесь одной из следующих услуг:</p>\n\n<p><strong><em>Закрепить проект</em></strong> – проект будет оставаться на главной странице и не будет смещаться вниз при появлении других новых проектов.</p>\n\n<p><strong><em>Выделить проект</em></strong> – проект выделяется другим цветом и становится более заметным для исполнителей.</p>\n\n<p>Услугами можно воспользоваться в разделе «Мои проекты» главного меню. Выберите интересующую услугу под проектом, укажите желаемый срок предоставления услуги, пополните счет и активируйте услугу.</p>\n\n<p> </p>\n\n<p><strong>Поиск исполнителя по каталогу.</strong></p>\n\n<p>На сайте <a href="http://freecer.net/">http://freecer.net</a> вы можете выбирать исполнителей не только из тех, кто увидел ваш проект и оставил к нему заявку, но и из всех, кто зарегистрирован на сайте. Для выбора фрилансеров из общего списка перейдите в раздел «Исполнители», укажите интересующую вас категорию, при необходимости выберите регион.</p>\n\n<p>При просмотре каталога исполнителей мы рекомендуем обращать внимание на тех фрилансеров, которые находятся в начале списка и имеют наибольший рейтинг. Также просматривайте отзывы от других заказчиков, обращайте внимание на работы в портфолио и на то, как заполнено резюме.</p>\n\n<p>Вы можете выбирать исполнителей, изучая раздел «Последние работы исполнителей» на главной странице. С авторами понравившихся работ можно связываться напрямую через личные сообщения и предлагать им сотрудничество. Для того, чтобы гарантировать выполнение обязательств, настоятельно рекомендуем создавать проект и проводить сотрудничество через сервис, даже если вы нашли подходящего фрилансера по каталогу.</p>\n\n<p> </p>\n', 'html', 'Правила-аказчикам', 1, 1440036593, 1440036180, 0, 1440036593, 0, '', 0, 10, 0.00, 0);
