(8, 'Тыжкопирайтер-8', 0, 'articles', 'Тыжкопирайтер', 'Заблуждения о копирайтерах', 'копирайтер, написание текстов', 'Тыжкопирайтер', 'Заблуждения о копирайтерах', '<p><span style="color:rgb(0,0,0);font-family:tahoma, arial, verdana, sans-serif, ''Lucida Sans'';font-size:11px;line-height:16.9400005340576px;">Трудовым будням простых копирайтеров (темных лошадок-авторов) посвящается.</span><br style="color:rgb(0,0,0);font-family:tahoma, arial, verdana, sans-serif, ''Lucida Sans'';font-size:11px;line-height:16.9400005340576px;" /><span style="color:rgb(0,0,0);font-family:tahoma, arial, verdana, sans-serif, ''Lucida Sans'';font-size:11px;line-height:16.9400005340576px;">Неважно работаете Вы удаленно или же в офисе – но Вы пишите тексты в довольно больших объемах, а когда что-то Вас смущает, и Вы пытаетесь донести это до начальника/заказчика, то слышите: «Ну, ты ж копирайтер!». Итак, надо понимать, что должен делать простой (пока еще не супер) «тыжкопирайтер»:</span><br style="color:rgb(0,0,0);font-family:tahoma, arial, verdana, sans-serif, ''Lucida Sans'';font-size:11px;line-height:16.9400005340576px;" /><br style="color:rgb(0,0,0);font-family:tahoma, arial, verdana, sans-serif, ''Lucida Sans'';font-size:11px;line-height:16.9400005340576px;" /><span style="color:rgb(0,0,0);font-family:tahoma, arial, verdana, sans-serif, ''Lucida Sans'';font-size:11px;line-height:16.9400005340576px;">1. «Тыжкопирайтер» - человек, который может писать из головы обо всем – от танкостроения, до детских памперсов</span><br style="color:rgb(0,0,0);font-family:tahoma, arial, verdana, sans-serif, ''Lucida Sans'';font-size:11px;line-height:16.9400005340576px;" /><span style="color:rgb(0,0,0);font-family:tahoma, arial, verdana, sans-serif, ''Lucida Sans'';font-size:11px;line-height:16.9400005340576px;">2. «Тыжкопирайтер» обладает такой скоростью набора теста, что Bugatti Veyron и гепард отдыхают.</span><br style="color:rgb(0,0,0);font-family:tahoma, arial, verdana, sans-serif, ''Lucida Sans'';font-size:11px;line-height:16.9400005340576px;" /><span style="color:rgb(0,0,0);font-family:tahoma, arial, verdana, sans-serif, ''Lucida Sans'';font-size:11px;line-height:16.9400005340576px;">3. «Тыжкопирайтер» пишет 100 000 знаков без пробелов в день, не отвлекаясь на бытовые мелочи типа – туалет, поесть, поспать. Он печатающий робот.</span><br style="color:rgb(0,0,0);font-family:tahoma, arial, verdana, sans-serif, ''Lucida Sans'';font-size:11px;line-height:16.9400005340576px;" /><span style="color:rgb(0,0,0);font-family:tahoma, arial, verdana, sans-serif, ''Lucida Sans'';font-size:11px;line-height:16.9400005340576px;">4. «Тыжкопирайтер» чаще всего фрилансер который следит за уведомлением о новом заказе в любое время дня и ночи.</span><br style="color:rgb(0,0,0);font-family:tahoma, arial, verdana, sans-serif, ''Lucida Sans'';font-size:11px;line-height:16.9400005340576px;" /><span style="color:rgb(0,0,0);font-family:tahoma, arial, verdana, sans-serif, ''Lucida Sans'';font-size:11px;line-height:16.9400005340576px;">5. «Тыжкопирайтер» способен написать +100500 экземпляров текста на одну тему.</span><br style="color:rgb(0,0,0);font-family:tahoma, arial, verdana, sans-serif, ''Lucida Sans'';font-size:11px;line-height:16.9400005340576px;" /><span style="color:rgb(0,0,0);font-family:tahoma, arial, verdana, sans-serif, ''Lucida Sans'';font-size:11px;line-height:16.9400005340576px;">6. «Тыжкопирайтер» способен залить все на сайт, вставить картинки, добавить видео/музыку и подработать на голом энтузиазме контент-менеджером.</span><br style="color:rgb(0,0,0);font-family:tahoma, arial, verdana, sans-serif, ''Lucida Sans'';font-size:11px;line-height:16.9400005340576px;" /><span style="color:rgb(0,0,0);font-family:tahoma, arial, verdana, sans-serif, ''Lucida Sans'';font-size:11px;line-height:16.9400005340576px;">7. У «Тыжкопирайтера» нет секса в принципе – 24 часа в сутки он пишет, ищет инфу. Хочет секса – пишет статью о сексе. Все гуд. Миссия выполнена.</span><br style="color:rgb(0,0,0);font-family:tahoma, arial, verdana, sans-serif, ''Lucida Sans'';font-size:11px;line-height:16.9400005340576px;" /><span style="color:rgb(0,0,0);font-family:tahoma, arial, verdana, sans-serif, ''Lucida Sans'';font-size:11px;line-height:16.9400005340576px;">8. «Тыжкопирайтер» может сам себе составить ТЗ, зная наперед,что Ваши SEOшники выбрали именно такие ключевые слова.</span><br style="color:rgb(0,0,0);font-family:tahoma, arial, verdana, sans-serif, ''Lucida Sans'';font-size:11px;line-height:16.9400005340576px;" /><span style="color:rgb(0,0,0);font-family:tahoma, arial, verdana, sans-serif, ''Lucida Sans'';font-size:11px;line-height:16.9400005340576px;">9. «Тыжкопирайтер» без труда впишет в текст ключ типа «вымя подоенной коровы лучшая цена» или «Мухосранск отель».</span><br style="color:rgb(0,0,0);font-family:tahoma, arial, verdana, sans-serif, ''Lucida Sans'';font-size:11px;line-height:16.9400005340576px;" /><span style="color:rgb(0,0,0);font-family:tahoma, arial, verdana, sans-serif, ''Lucida Sans'';font-size:11px;line-height:16.9400005340576px;">10. «Тыжкопирайтер» никогда не занят – когда он пишет, он просто разминает пальцы на клавиатуре.</span><br style="color:rgb(0,0,0);font-family:tahoma, arial, verdana, sans-serif, ''Lucida Sans'';font-size:11px;line-height:16.9400005340576px;" /><span style="color:rgb(0,0,0);font-family:tahoma, arial, verdana, sans-serif, ''Lucida Sans'';font-size:11px;line-height:16.9400005340576px;">11. «Тыжкопирайтер» примитивный обработчик информации, лучшим другом которого, является поисковый робот – он единственный читает его тексты.</span><br style="color:rgb(0,0,0);font-family:tahoma, arial, verdana, sans-serif, ''Lucida Sans'';font-size:11px;line-height:16.9400005340576px;" /><span style="color:rgb(0,0,0);font-family:tahoma, arial, verdana, sans-serif, ''Lucida Sans'';font-size:11px;line-height:16.9400005340576px;">12. «Тыжкопирайтер» всегда готов переписать текст – скажу больше, он перечитывает свои тексты и предлагает Вам сам бесплатно переписать.</span><br style="color:rgb(0,0,0);font-family:tahoma, arial, verdana, sans-serif, ''Lucida Sans'';font-size:11px;line-height:16.9400005340576px;" /><span style="color:rgb(0,0,0);font-family:tahoma, arial, verdana, sans-serif, ''Lucida Sans'';font-size:11px;line-height:16.9400005340576px;">13. «Тыжкопирайтер» = Google translator, Мультиязычная проверка орфографии онлайн и т.д.</span><br style="color:rgb(0,0,0);font-family:tahoma, arial, verdana, sans-serif, ''Lucida Sans'';font-size:11px;line-height:16.9400005340576px;" /><span style="color:rgb(0,0,0);font-family:tahoma, arial, verdana, sans-serif, ''Lucida Sans'';font-size:11px;line-height:16.9400005340576px;">14. «Тыжкопирайтер» рад если Вы ему предложите написать текст об очистке унитазов, примет заказ с улыбкой и напишет текст о них с талантом Пушкина.</span><br style="color:rgb(0,0,0);font-family:tahoma, arial, verdana, sans-serif, ''Lucida Sans'';font-size:11px;line-height:16.9400005340576px;" /><span style="color:rgb(0,0,0);font-family:tahoma, arial, verdana, sans-serif, ''Lucida Sans'';font-size:11px;line-height:16.9400005340576px;">15. «Тыжкопирайтер» всегда пишет "продающие тесты" у него мозг так заточен - он не знает ни о каких жанрах в литературе и журналистике, кроме "рекламная статья, полезная читателю".</span><br style="color:rgb(0,0,0);font-family:tahoma, arial, verdana, sans-serif, ''Lucida Sans'';font-size:11px;line-height:16.9400005340576px;" /><span style="color:rgb(0,0,0);font-family:tahoma, arial, verdana, sans-serif, ''Lucida Sans'';font-size:11px;line-height:16.9400005340576px;">16. «Тыжкопирайтер» если работает удаленно сражается не хуже льва или гризли за каждый заказ...</span><br style="color:rgb(0,0,0);font-family:tahoma, arial, verdana, sans-serif, ''Lucida Sans'';font-size:11px;line-height:16.9400005340576px;" /><span style="color:rgb(0,0,0);font-family:tahoma, arial, verdana, sans-serif, ''Lucida Sans'';font-size:11px;line-height:16.9400005340576px;">17. «Тыжкопирайтер» никогда не работает за сумму больше чем 1$ за одну полноценную статью – ведь он не ест, не пьет (пункт 3), и не тратиться на контрацепцию (пункт 7).</span></p>\n', 'html', 'Копирайтерский фольклор', 17, 1441624363, 1440012540, 0, 1441624363, 0, '', 0, 56, 0.00, 0),
(12, 'Начало-работы', 0, 'system', 'Начало работы', '', '', '', '', '<p><strong>Регистрация.</strong></p>\n\n<p>В сервисе <a href="http://freecer.net/">http://freecer.net</a> каждый пользователь может зарегистрироваться только один раз, в качестве заказчика или в качестве исполнителя. Процедура регистрации бесплатна, занимает всего несколько минут и требует от пользователя подтверждения по электронной почте.</p>\n\n<p> </p>\n\n<p><strong>Заполнение профиля.</strong></p>\n\n<p>Чтобы работа на <a href="http://freecer.net/">http://freecer.net</a> была более эффективной, после регистрации мы рекомендуем заполнить свой профиль, предоставив как можно больше информации, интересной для заказчиков или исполнителей.</p>\n\n<p>Указывайте актуальные и правдивые персональные данные, такие как имя, фамилия, страна проживания и номер телефона. Это повысит уровень доверия к вашей странице и при возникновении проблем с аккаунтом поможет восстановить к нему доступ. Указать информацию о себе можно в разделе «Настройки» в личном кабинете.</p>\n\n<p>Загрузите аватар, чтобы ваш аккаунт выделялся в числе других и был более запоминающимся. В качестве аватара можно использовать свою фотографию, логотип компании или другое изображение, которое будет уместным для поиска работодателей или исполнителей.</p>\n\n<p>Исполнителям следует особенно тщательно подойти к заполнению страницы «Информация». Разместите там свое резюме, в котором расскажите о прошлом опыте работы, о своих навыках и конкурентных преимуществах. Если необходимо, укажите активные ссылки на рекомендации, примеры работ или другую информацию. Чтобы резюме хорошо читалось, пользуйтесь кнопками форматирования, выделяйте заголовки, создавайте списки и т.д.</p>\n\n<p>В разделе «Контакты» укажите актуальную контактную информацию для связи с вами. Адрес электронной почты, указанный в вашем профиле, будет использоваться для сервисных уведомлений и смены пароля.</p>\n\n<p>В настройках профиля вы можете указать ссылку на свой аккаунт в социальных сетях, при помощи которого можно будет осуществлять авторизацию на сайте. Привязка осуществляется только к одной странице в социальной сети.</p>\n\n<p> </p>\n\n<p><strong><em>Портфолио.</em></strong></p>\n\n<p>Данный раздел доступен и актуален только для исполнителей. Чтобы повысить шансы на успешный поиск заказчиков, мы рекомендуем выкладывать в портфолио наиболее удачные, на ваш взгляд, работы. На <a href="http://freecer.net/">http://freecer.net</a> запрещено публиковать работы, которые являются чужой интеллектуальной собственностью или содержат материалы, запрещенные к публикации действующим законодательством.</p>\n\n<p>За первые пять работ, опубликованных на сайте, исполнитель получает по 1 баллу к рейтингу. Недавно опубликованные работы из портфолио исполнителей появляются на главной странице (при условии, что они сопровождаются изображением-превью).</p>\n\n<p> </p>\n\n<p><strong>Магазин.</strong></p>\n\n<p>Заказчики и исполнители могут покупать и продавать в разделе «Магазин» любые объекты своей интеллектуальной собственности, например, собственные фотографии, векторные изображения, видеоуроки, тексты, программные модули и т.д.</p>\n\n<p>Правилами сервиса запрещено продавать продукты, скачанные бесплатно или купленные на других ресурсах, а также товары, которые не принадлежат тому, кто их размещает. Перед размещением в магазине все товары проходят проверку. Товары, которые противоречат действующему законодательству об интеллектуальной собственности, выполнены ненадлежащим образом или не принадлежат их автору, не публикуются в Магазине.</p>\n\n<p>Чтобы увеличить вероятность покупки вашего товара, указывайте подходящую категорию, сопровождайте товар подробным описанием или видеообзором, загружайте файл-превью и устанавливайте конкурентную цену.</p>\n\n<p>Сервис взимает комиссию с каждого проданного товара в размере 10% от его стоимости. Комиссия взимается с продавца. Деньги с продажи поступают на счет продавца через 14 дней после продажи, если в течение этого времени покупатель не обратится в администрацию с жалобой на качество товара.</p>\n\n<p>Если вы хотите купить товар в магазине, используйте поиск по категориям или пользуйтесь ручным поиском. Старайтесь покупать товары у авторов с высоким рейтингом и с положительными отзывами. На каждый купленный товар Магазин дает гарантию. В течение 14 дней с момента покупки вы можете обратиться в арбитраж и вернуть деньги, если товар окажется некачественным и это будет подтверждено арбитражем сервиса.</p>\n\n<p> </p>\n\n<p><strong>Блог.</strong></p>\n\n<p>Блог позволяет пользователям общаться в рамках сервиса, делиться профессиональным опытом, рассказывать о своих достижениях или корпоративных новостях. Записи в блогах можно сопровождать активными ссылками, иллюстрациями или другими файлами мультимедиа.</p>\n\n<p>Каждая запись в блоге проходит проверку модератора. Статьи, посты для блога и комментарии к постам не должны содержать ненормативной лексики, оскорблений и клеветы в адрес других пользователей или информации, противоречащей действующему законодательству. Материалы, которые не соответствуют этим правилам, подлежат удалению.</p>\n\n<p>При написании постов и комментариев старайтесь следовать правилам орфографии и пунктуации, проявляйте уважение к другим пользователям, будьте корректными при участии в дискуссиях. Блог – это, прежде всего, лицо вашего аккаунта, он характеризует вас с профессиональной точки зрения так же, как и резюме или портфолио.</p>\n\n<p>Если вы решили вести блог, старайтесь делать его максимально полезным для представителей своей целевой аудитории. В этом случае блог станет вашей дополнительной и бесплатной рекламой, позволит заслужить хорошую репутацию среди других пользователей и сторонних посетителей сайта.</p>\n\n<p> </p>\n\n<p><strong>Безопасная сделка.</strong></p>\n\n<p>Чтобы гарантировать выполнение обязательств по отношению друг к другу, заказчик и исполнитель могут подкрепить свое сотрудничество, оформим сделку на сайте. При этом со счета заказчика будет списана стоимость проекта + 10% за услуги сайта. Средства будут переведены на счет исполнителя только после того, как заказчик подтвердит, что все обязательства со стороны исполнителя по проекту выполнены.                            </p>\n\n<p>Для оформления сделки заказчик выбирает исполнителя из тех, кто подал заявку к его проекту. Он должен обсудить с фрилансером детали сотрудничества через личные сообщения и нажать «Предложить сделку» на странице проекта.</p>\n\n<p>Заказчик должен четко и подробно сформулировать задание, указать сроки и сумму сделки, после чего дождаться, когда исполнитель подтвердит свое участи в сделке.</p>\n\n<p>После того, как исполнитель получит уведомление о новой сделке, он должен согласиться или отказаться от нее. В случае согласия заказчик оплачивает указанную сумму, к которой добавляется комиссия сервиса. Средства временно замораживаются на счету сайта и переводятся на счет исполнителя после подтверждения выполнения работы. Исполнитель может вывести деньги при помощи одной из доступных платежных систем.</p>\n\n<p> </p>\n', 'html', '', 1, 1440036780, 1440036780, 0, 1440037368, 0, '', 0, 15, 0.00, 0),
(15, 'Правила-форумов', 0, 'system', 'Правила форумов', '', '', '', '', '<p><strong>Пользователи, которые участвуют в обсуждениях форума, обязаны:</strong></p>\n\n<ol><li>Проявлять уважение к другим участникам форума и читателям, вести дискуссии вежливо и корректно.</li>\n	<li>Избегать нецензурной лексики, оскорблений и сообщений, провоцирующих конфликты.</li>\n	<li>Стараться не допускать орфографических и пунктуационных ошибок, пользоваться знаками препинания и заглавными буквами при необходимости.</li>\n	<li>Давать новым темам информативные названия, стараться избегать таких названий как «Помогите», «У меня вопрос» и т.д.</li>\n	<li>При создании новых тем использовать поиск, чтобы избегать повторов.</li>\n	<li>Размещать темы и сообщения в подходящих для этого ветках и разделах.</li>\n</ol><p><strong>Пользователям форума запрещается:</strong></p>\n\n<ol><li>Размещать в темах и сообщениях несанкционированную рекламу или реферальные ссылки на другие ресурсы.</li>\n	<li>Публиковать ссылки на вредоносное программное обеспечение.</li>\n	<li>Использовать форум для поиска заказчиков или исполнителей.</li>\n	<li>Продавать или покупать свои услуги или какие-либо товары.</li>\n	<li>Обсуждать работу конкретных пользователей без их согласия, обвинять кого-либо в невыполнении обязательств по отношению к заказчикам или исполнителям, публиковать сообщения, которые можно расценить как клевету.</li>\n	<li>Злоупотреблять заглавными буквами, смайликами или форматированием в тексте сообщений.</li>\n	<li>Поднимать свои темы вверх списка путем публикации неинформативных сообщений, таких как «ап темы», «+» и т.д.</li>\n	<li>Размещать на форуме дублирующие темы или сообщения.</li>\n	<li>Публиковать объявления о сборе материальной помощи, благотворительности и т.д.</li>\n	<li>Предлагать любые мошеннические виды заработка в Интернете.</li>\n</ol><p><strong>За нарушение этих правил модераторы могут выставить предупреждение. При получении трех предупреждений пользователь лишается права публиковать темы и сообщения на форуме в течение шести месяцев.</strong></p>\n', 'html', '', 1, 1440037140, 1440037020, 0, 1440037172, 0, '', 0, 17, 0.00, 0);
