(34, 0, 0, 29, 0, 1441467753, 1441570657, '', 'slogans-naming', 3, 'Придумать короткий слоган', 'Придумать-короткий-слоган', NULL, NULL, NULL, NULL, '<p>Придумать короткий слоган для нашего сервиса <a href="http://www.freecer.net">www.freecer.net</a></p>\r\n\r\n<p>Важна строгость, информативность, доступность понимания широкой аудитории.</p>\r\n\r\n<ul>\r\n	<li>Суть привлечение клиентов - работодателей.</li>\r\n	<li>Привлечение исполнителей по специализации программирование, дизайн, копирайтинг.</li>\r\n</ul>\r\n\r\n<p>Слоган будет размещён на баннере (прикрепление №1)</p>\r\n\r\n<p><strong>Срок конкурса&nbsp;10 дней с момента публикации.&nbsp;</strong></p>\r\n', 20.00, 165, 9, '0', 0, 0, 0, 0, 0),
(35, 0, 0, 29, 0, 1441632354, 1441642621, '', 'jobs', 2, 'Должность модератора форума', 'Должность-модератора-форума', NULL, NULL, NULL, NULL, '<p><span style="color:rgb(0,0,0);font-family:arimoregular, Tahoma, Arial, Georgia;line-height:normal;">Для развивающегося сайта услуг&nbsp;</span> <a class="vnesh_main" href="http://www.freecer.net/" style="color:rgb(23,146,151);font-family:arimoregular, Tahoma, Arial, verdana, Georgia, sans-serif, helvetica;">www.freecer.net</a> <span style="color:rgb(0,0,0);font-family:arimoregular, Tahoma, Arial, Georgia;line-height:normal;">&nbsp;необходим модератор в раздел форума. (4 кандидата)</span><br style="color:rgb(0,0,0);font-family:arimoregular, Tahoma, Arial, Georgia;line-height:normal;" />\r\n<span style="color:rgb(0,0,0);font-family:arimoregular, Tahoma, Arial, Georgia;line-height:normal;">Требования к кандидатам:</span><br style="color:rgb(0,0,0);font-family:arimoregular, Tahoma, Arial, Georgia;line-height:normal;" />\r\n<span style="color:rgb(0,0,0);font-family:arimoregular, Tahoma, Arial, Georgia;line-height:normal;">Опыт работы модератором более 1 года</span><br style="color:rgb(0,0,0);font-family:arimoregular, Tahoma, Arial, Georgia;line-height:normal;" />\r\n<span style="color:rgb(0,0,0);font-family:arimoregular, Tahoma, Arial, Georgia;line-height:normal;">Грамотность, постоянная связь, сдержанность. понимание тематики сайта - обязательно.</span><br style="color:rgb(0,0,0);font-family:arimoregular, Tahoma, Arial, Georgia;line-height:normal;" />\r\n<br style="color:rgb(0,0,0);font-family:arimoregular, Tahoma, Arial, Georgia;line-height:normal;" />\r\n<span style="color:rgb(0,0,0);font-family:arimoregular, Tahoma, Arial, Georgia;line-height:normal;">Оплата:&nbsp;</span><br style="color:rgb(0,0,0);font-family:arimoregular, Tahoma, Arial, Georgia;line-height:normal;" />\r\n<span style="color:rgb(0,0,0);font-family:arimoregular, Tahoma, Arial, Georgia;line-height:normal;">Обговаривается отдельно с каждым кандидатом</span></p>\r\n\r\n<p><font color="#000000" face="arimoregular, Tahoma, Arial, Georgia"><span style="line-height:normal;">Срок рассмотрения резюме 20 дней с момента публикации проекта.&nbsp;</span></font></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><font color="#000000" face="arimoregular, Tahoma, Arial, Georgia"><span style="line-height: normal;">p.s &nbsp;Прикладывайте пожалуйста резюме.</span></font></p>\r\n', 0.00, 180, 16, 'ua', 0, 0, 0, 0, 0);
