(42, 35, 1441641788, 57, 'Здравствуйте! Меня зовут Крылов Дмитрий Александрович. Хочу работать модератором сайта.\nвозраст 41 год\nобразование: высшее гуманитарное ( исторический факультет, диплом с отличием)\nличные качества: коммуникабельность, внимательность, ответственность, обучаемость\nопыт работы: размещение постов на форумах, копирайтинг, рерайтинг\nплатежные реквизиты:р/с Сбербанка России 42307810553003991548 бик 046126614 корр.счет 30101810500000000614\nqiwi кошелек +79537308531', 0, 0, 0, 0, 0, '', 0, 1),
(43, 35, 1441642101, 58, 'Добрый день. Заинтересовала ваша вакансия модератора (удаленно).\n\nО себе:\nФИО Лямина Татьяна Витальевна\nТелефон 89536038779\nОпыт удаленной работы\nСентябрь 2012 —февраль 2014\nOOO "Мониторинг социальных медиа"\nИнформационные технологии, системная интеграция, интернет..\n \nасессор (удаленная работа)\nанализ онлайн потока упоминаний о бренде из социальной сети, отсечение спама, отбор стоп-слов, подготовка личной отчетности. \nОпыт составления запросов (Яндекс.Блоги)\nФерваль  2014 —Июнь 2015\nАвиакасса\n\n оператор чата (удаленная работа)\nконсультация клиентов онлайн по вопросам покупки, возврата,обмена авиа жд билетов. ', 0, 0, 0, 0, 0, '', 0, 1),
(44, 35, 1441643569, 60, 'Здравствуйте. Меня зовут Наталья.\nЗаинтересовала данная вакансия. Образование высшее. Работать могу с 14:00 до 22:00, т.е. время на работу есть. Также имеется опыт работы в данной сфере и удаленной работы. Модератором на сайте работала 1,5 года. И модератом в чате игры-месяц. Знаю правила постинга,орфографии,пунктуации,также многих компьютерных программ на среднем уровне. Быстро обучаюсь. Знаю английский язык.\nИнтересующие Вас вопросы, задавайте на почту:natali.natali.2014@bk.ru\n', 1, 0, 1, 0, 0, '', 0, 1),
(45, 35, 1441644292, 59, 'Кидаю вам сюда резюме, то как на сайт оно не загружается. \nСтолярчук Яна Николаевна \n\nE-mail: yasya5@inbox.ru\nДата рождения: 5.03.1994\n\nЦель: получить работу модератора.\n\nОбразование: неоконченное высшее, 4-ый курс.\nУниверситет – Херсонский государственный университет.\nСпециальность – Иностранная филология.\nСпециализация – Английский, русский язык и литература. \n\nЗнание иностранных языков: английский язык – Upper-Intermediate, британский английский и акцент. \n\nОпыт: Есть опыт работы с группами Вконтакте и наполнением их. \n\nЛичные качества: \n- могу выполнять монотонную работу;\n- могу работать в коллективе;\n- коммуникабельная; \n- ответственная;\n- трудолюбивая;\n- организованная; \n- целеустремленная;\n\nДополнительная информация:\n- вредных привычек не имею;\n- занимаюсь репетиторством;\n- люблю животных.\n\n\n', 1, 0, 12, 0, 2, '', 0, 1),
(46, 35, 1441649260, 62, 'Здравствуйте,хочу предложить свои услуги.Работал модератором на СаратовМебель.РФ.Опыт работы 1.5 года.Постоянный доступ к компьютеру и интернету.Коммуникабелен,с тематикой сайта ознакомлюсь быстро.Возраст 22 года.Имею высшее образование,закончил в этом году СГТУ.Факультет Информатика и вычеслительная техника.Что ещё добавить?К работу отношусь с полной серьезностью,выполняю в срок.', 200, 0, 0, 0, 0, '', 0, 1),
(47, 35, 1441649898, 63, 'Очень заинтересована в стабильном и постоянном (или очень долгосрочном) сотрудничестве.\nГотова начинать работу прямо сейчас.\nЗа 6 лет работы на фрилансе знаю все тонкости в этой сфере, поэтому прекрасно подойду на роль модератора форума.\nИмею опыт работы модератором в соцсетях.\nВсе подробности есть в резюме.', 1, 0, 1, 0, 0, '', 0, 1),
(48, 34, 1441650356, 63, '1. Freecer - для тех, кому надоело "просиживать" свою жизнь в офисе.\n2. Хватит "просиживать" жизнь в офисе, работай, когда хочешь.\n3. С Freecer у тебя появится время на то, для чего ты зарабатываешь.', 0, 0, 0, 0, 0, '', 0, 1),
(49, 35, 1441656204, 64, 'Доброго вечера.\nМеня зовут Светлана, 22 года, высшее психологическое образование.\nВаша вакансия меня очень заинтересовала.\nОпыт удалённой работы имеется.\nТакже, присутствует опыт работы модератором (в чате он-лайн игры "Игры престолов")\nРаботаю удалённо специалистом тех.поддержки клиентов.\nНо, так как это подработка, то ищу ещё одну, также удалённую.\nПодробнее с моим резюме можете ознакомиться по следующей ссылке: http://kstovo.hh.ru/resume/71e38dc8ff01ff16c80039ed1f4a49696e5936', 0, 0, 0, 0, 0, '', 0, 1),
(50, 35, 1441660907, 67, 'Меня зовут Екатерина г.Москва\nЯ занимаюсь двумя отраслями дизайн – Дизайн среды и Графический дизайн.\nВ совершенстве владею всеми аспектами данных направлений\nУспешно работаю дизайнером более 6 лет, за это время принимала заказы от многих известных фирм как в России так и за рубежом (США,Китай,Япония,Германия,Франция)\nПОРТФОЛИО http://alexandrovamila.wix.com/malix\nГАРАНТИЯ ВЫПОЛНЕНИЯ ПРОЕКТОВ В СРОК!\nТолько уникальные ,авторские работы, 0 плагиата.\nРаботаю на результат и качество, ни каких сырах вариантов и не доработок ,всегда довожу работу до конца .Умею работать с людьми всегда прислушиваюсь к пожеланиям заказчика.\nПобедительница многочисленных международных конкурсов.\nИмею два высших образования по специальностям–Дизайнер и Архитектор.\nВладею следующими программами: \nPhotoshop\nIllustrator\nInDesign\nCorelDRAW\nSAI\nAutoCAD\nArchiCAD', 0, 0, 1, 0, 0, '', 0, 1),
(51, 35, 1441662081, 68, 'Здравствуйте, с радостью устроюсь к вам на работу!', 1, 0, 30, 0, 0, '', 0, 1),
(52, 35, 1441691274, 69, 'Здравствуйте, готов с вами сотрудничать.\n\nЗнания и навыки:\n\n    большой опыт работы на компьютере,\n    отличное знание офисных программ,\n    работа в интернет,опыт работы модератором 2 года.\n\nДополнительная информация: Внимательность, ответственность,\nэнергичность, качественное выполнение поставленных задач,\nаккуратность, желание учиться и повышать квалификацию, стремление к\nросту.', 0, 0, 0, 0, 0, '', 0, 1),
(53, 35, 1441695741, 70, 'Здравствуйте , есть опыт работы модератором , а также большой опыт в тех поддержке LP-GENERATOR.\n Рабочий день могу строить как в дневную , так и в ночную смену .\n Готов к высоким нагрузкам .\n Готов пройти тестовый период .\n Не подвожу , всегда на связи .\n На фрилансе уже более  7 лет , со всеми тонкостями работы знаком .\n skype-alekveb\nСпасибо !\n skype- alekveb\nС ув. Александр !', 1, 0, 12, 0, 0, '', 0, 1),
