(56, 35, 1441723778, 74, 'Здравствуйте!\nПредлагаю рассмотреть моё резюме на вакансию в качестве удалённого сотрудника.\nОпыт работы модератором форумов есть, как и опыт удаленной работы - тематика очень хорошо знакома.\nОтветственен, внимателен, быстро обучаем, трудолюбив, креативен.\nСвязь постоянная, интерент стабилен.\nГотов к сотрудничеству.\nС уважением, \nАлексей Харин', 0, 0, 0, 0, 0, '', 0, 1),
