(59, 34, 1441888702, 79, 'Freecer Лучшая работа и лучшие работники\nFreecer Быстрый путь от надо сделать к сделано.\nFreecer Кому работу? Кому работников? Налетай!\nFreecer Лучшая работа для лучших работников\nFreecer Интересный труд для каждого\nFreecer  Хорошему работнику хорошая работа!\nFreecer Лучшая работа для фрилансеров\nFreecer И дело спорится! \nFreecer  Флиланс с гарантией\nFreecer для работы и работника\nС Freecer работа будет сделана\nС Freecer дело спорится!\n', 0, 0, 0, 0, 0, '', 0, 0),
