(81, 0, 'nvorobieva', 'c9ba849da9971c7ef68aba74745e2f84795bc9e2b30b8d8aa99a0e3b6bc90ae0', 'sha256', 'fdf8bf4ccc2f8849', 4, '0', 'GMT', '<p>Добрый день!</p>\n\n<p>Оказываю услуги по переводу текстов с/на английский язык. Опыт работы с переводами составляет более 5 лет. Тематика: техническая литература, деловая переписка/корреспонденция (включая договоры), общая тематика и т.д. Образование - высшее, специальность - лингвист/преподаватель английского языка.</p>\n\n<p>Со своей стороны гарантирую выполнение работы в срок, качество и оперативность</p>\n', '1987-04-23', 'U', 'nvorobieva87@mail.ru', 1, '', 'default', 'ru', 1441881228, 1442165384, 1441991309, '176.195.190.30', 2, 'c1381c76a3e51bcc80053ffa23eec7e2d255b4a414a8e029825ab4d81da6a7aa', 1441991294, '0ee3d861c2ca4fd92ae3212a4e5fbe13', '', 'cf03e22fd38907cf', 0, 0, 0, 'correspondence-business-correspondence,translation-of-general-subjects,technical-translation', '228', '', 4, 0, '', 'Воробьева', 'Нина', 0, '', '', '', '', '', '', '', '', 0, 1, 1, 0, 17, 0, ''),
