(47, 0, 'koss_niezhentsev', 'c64b33353ce09272f1c1b2f67add1d87', 'sha256', '060546aaebf343e3', 4, 'ua', 'GMT', '<p><strong style="line-height:20.8px;">Создание тестовой документации.</strong></p>\n\n<p><strong>Полное тестирование web/mobile проектов.</strong></p>\n\n<ul><li>Функциональное тестирование</li>\n	<li>Не функциональное тестирование</li>\n	<li>Регрессионное тестирование</li>\n	<li>Тестирование графического интерфейса пользователя</li>\n	<li>Кросс платформенное, кросс браузерное тестирование</li>\n	<li>Анализ юзабилити</li>\n</ul><p><strong>Языки: </strong></p>\n\n<ul><li>Русский (родной)</li>\n	<li>Украинский (родой)</li>\n	<li>Английский (intermediate)</li>\n</ul><p><em>Опыт в тестировании 1,5 года.</em></p>\n\n<p> </p>\n', '1982-09-23', 'M', 'koss1982en@gmail.com', 1, '', 'default', 'ru', 1441629900, 1442178108, 1441635490, '185.11.28.115', 4, '06fd6a7c805bcc2e6fc2719fce4f16fe8139bf48d279d26a37a25a5b73f45fb0', 1441653901, 'c1ea4bcac1ec94405b6a50d45da58296', '', '4e78f021e24e6a14', 0, 0, 0, 'project-manager,qa-testing,usability-analysis', '207', '', 4, 0, '', 'Nezhentsev', 'Konstantin', 0, '', '', '', '', 'https-www-facebook-com-app_scoped_user_id-963845723674420', 'https://www.facebook.com/app_scoped_user_id/963845723674420/', '', '', 1, 1, 1, 0, 3, 1, NULL),
