(84, 0, 'Dmitriy', 'f748960c3ff19f226dc95fa2a95929f1eb99d3115de9fa892a70f026603253da', 'sha256', '940a7cbe7b9b6ada', 4, 'ru', 'GMT', 'Профессиональное создание сайтов, разработка фирменного стиля, логотипов.\n Дизайн печатной продукции (баннера, ситилайты, визитки, фирменные бланки, листовки, буклеты, брошюры, постеры, календари).\n Также мы верстаем глянцевые журналы и каталоги.\n Мы изготовляем flash баннера, flash презентации, анимационные элементы для сайтов, анимационные открытки, gif анимацию.\nОсновные направления деятельности:\n\nОсновные направления деятельности:\n\n• разработка web-страниц • проекты по наружной рекламе • дизайн интернет-баннеров • логотипы • фирменный стиль • дизайн и верстка журналов • дизайн плакатов • афиши • календари • буклеты • этикетки •\n\nКак мы работаем:\nВ работу принимаются проекты с четким техническим заданием. Шаблоны анкет под разные виды услуг \nПосле обсуждения деталей, происходит просчет стоимости работ.\nКлиентом вносится предоплата в размере 50% от общей стоимости заказа.\nПервая презентация проделанной работы. Согласование дизайна. (В процессе выполнения работы возможно три незначительных исправлений готовой работы, которые выполняются по желанию заказчика. При дальнейших доработках осуществляем перерасчет стоимости проекта в зависимости от сложности поставленной задачи.)\nИтоговая презентация готового проекта. (Работа считается выполненной, если она соответствует всем пунктам технического задания и решает поставленную задачу.\nКлиентом вносятся 50% от общей стоимости заказа.\nКлиент получает оригинал\n\nНаши цены:\n\nКаждый проект для нас уникален, и к каждому мы подходим индивидуально. Окончательную стоимость и сроки на разработку дизайна можно сформировать только после детального ознакомления с предстоящей работой.\n\n\nmail - vasilovich.1982@mail.ru\n', '1982-09-07', 'M', 'vasilovich.1982@mail.ru', 1, '', 'default', 'ru', 1442169954, 1442250269, 1442223238, '212.2.159.156', 1, '9b368441f20d7bc03a72439a41f392361cd55